(11909, 'geodir_post_submited_success_email_content_admin', '<p>Dear Admin,</p><p>A new  listing has been published [#listing_link#]. This email is just for your information.</p><br><p>[#site_name#]</p>', 'yes'),
(11910, 'geodir_notify_post_edited', '0', 'yes'),
(11911, 'geodir_post_edited_email_subject_admin', '[[#site_name#]] Listing edited by Author', 'yes'),
(11912, 'geodir_post_edited_email_content_admin', '<p>Dear Admin,</p><p>A listing [#listing_link#] has been edited by it''s author [#post_author_name#].</p><br><p><b>Listing Details:</b></p><p>Listing ID: [#post_id#]</p><p>Listing URL: [#listing_link#]</p><p>Date: [#current_date#]</p><br><p>This email is just for your information.</p><p>[#site_name#]</p>', 'yes'),
(11913, 'geodir_post_submited_success_email_subject', 'Post Submitted Successfully', 'yes'),
(11914, 'geodir_post_submited_success_email_content', '<p>Dear [#client_name#],</p><p>You submitted the below listing information. This email is just for your information.</p><p>[#listing_link#]</p><br><p>Thank you for your contribution.</p><p>[#site_name#]</p>', 'yes'),
(11915, 'geodir_forgot_password_subject', '[#site_name#] - Your new password', 'yes'),
(11916, 'geodir_forgot_password_content', '<p>Dear [#client_name#],<p><p>You requested a new password for [#site_name_url#]</p><p>[#login_details#]</p><p>You can login here: [#login_url#]</p><p>Thank you,<br /><br />[#site_name_url#].</p>', 'yes'),
(11917, 'geodir_registration_success_email_subject', 'Your Log In Details', 'yes'),
(11918, 'geodir_registration_success_email_content', '<p>Dear [#client_name#],</p><p>You can log in  with the following information:</p><p>[#login_details#]</p><p>You can login here: [#login_url#]</p><p>Thank you,<br /><br />[#site_name_url#].</p>', 'yes');
