P初心者のため、今回実装したいコードへの応用が出来ず困っております。</p>\n<p>&lt;?php<br />\nif ( is_user_logged_in() ) {<br />\n	echo &#8216;Welcome, registered user!&#8217;;　→ログインユーザーは、ページ（/123.html)へリダイレクトしたい<br />\n} else {<br />\n	echo &#8216;Welcome, visitor!&#8217;;　　　　　　→非ログインユーザーは、ページ（/abc.html)をそのまま表示したい<br />\n}<br />\n?&gt;</p>\n<p>お手数ですが、何かアドバイス頂ければ助かります！<br />\n宜しくお願いいたします。</p>\n						\n					";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:7:"mikujin";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:2;a:6:{s:4:"data";s:55:"\n					\n					\n					\n					\n					\n\n					\n\n					\n					\n				";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:241:"https://ja.wordpress.org/support/topic/%e3%83%ad%e3%82%b0%e3%82%a4%e3%83%b3%e7%8a%b6%e6%85%8b%e3%82%92%e5%88%a4%e5%88%a5%e3%81%97%e3%81%a6%e3%83%aa%e3%83%80%e3%82%a4%e3%83%ac%e3%82%af%e3%83%88%e3%81%99%e3%82%8b%e6%96%b9%e6%b3%95/#post-210490";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:74:"返信先: ログイン状態を判別してリダイレクトする方法";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:241:"https://ja.wordpress.org/support/topic/%e3%83%ad%e3%82%b0%e3%82%a4%e3%83%b3%e7%8a%b6%e6%85%8b%e3%82%92%e5%88%a4%e5%88%a5%e3%81%97%e3%81%a6%e3%83%aa%e3%83%80%e3%82%a4%e3%83%ac%e3%82%af%e3%83%88%e3%81%99%e3%82%8b%e6%96%b9%e6%b3%95/#post-210490";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 03 Nov 2016 03:22:38 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:469:"\n						\n						<p>ログインしているかどうかを判定する関数に、is_user_logged_inがあるので、<br />\n<a href="https://wpdocs.osdn.jp/%E9%96%A2%E6%95%B0%E3%83%AA%E3%83%95%E3%82%A1%E3%83%AC%E3%83%B3%E3%82%B9/is_user_logged_in" rel="nofollow">https://wpdocs.osdn.jp/%E9%96%A2%E6%95%B0%E3%83%AA%E3%83%95%E3%82%A1%E3%83%AC%E3%83%B3%E3%82%B9/is_user_logged_in</a></p>\n<p>まずこの関数を使ってみてはいかがでしょうか。</p>\n						\n					";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:13:"Fumito MIZUNO";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:55:"\n					\n					\n					\n					\n					\n\n					\n\n					\n					\n				";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:251:"https://ja.wordpress.org/support/topic/x%e3%82%b5%e3%83%bc%e3%83%90%e3%83%bc%e3%81%a7%e3%81%bb%e3%81%ae%e3%82%b5%e3%83%96%e3%83%89%e3%83%a1%e3%82%a4%e3%83%b3%e5%9e%8b%e3%81%ae%e3%83%9e%e3%83%ab%e3%83%81%e3%82%b5%e3%82%a4%e3%83%88%e3%81%ae/#post-210486";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:96:"返信先: Xサーバーでのサブドメイン型のマルチサイトの作り方について";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:251:"https://ja.wordpress.org/support/topic/x%e3%82%b5%e3%83%bc%e3%83%90%e3%83%bc%e3%81%a7%e3%81%bb%e3%81%ae%e3%82%b5%e3%83%96%e3%83%89%e3%83%a1%e3%82%a4%e3%83%b3%e5%9e%8b%e3%81%ae%e3%83%9e%e3%83%ab%e3%83%81%e3%82%b5%e3%82%a4%e3%83%88%e3%81%ae/#post-210486";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 03 Nov 2016 02:02:02 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:3424:"\n						\n						<p>こんにちは。</p>\n<p>「作成されたサブドメイン名のディレクトリを削除する」<br />\nor<br />\n「リネームをしてpublic_htmlディレクトリ直下にサブドメイン名でpublic_htmlとにシンボリックリンクを張る」<br />\nと参考になさったサイトにありますから，</p>\n<blockquote>\n<pre><code>cd  tatara1.com/public_html\nln -s tatara1.com/public_html ./1.tatara1.com</code></pre>\n<p>1.tatara1.comの方はサブドメイン追加時に作成されたサブドメイン名のディレクトリを削除しました。<br />\nInternal Server Errorが表示されます。</p></blockquote>\n<blockquote>\n<pre><code>cd  tatara1.com/public_html\nln -s tatara1.com/public_html ./2.tatara1.com</code></pre>\n<p>2.tatara1.comの方はサブドメイン名のディレクトリの削除はしていません。<br />\n404エラーが表示されます。</p></blockquote>\n<p>はどちらも正常だと思います。</p>\n<p>前半は，「サブドメイン名のディレクトリ」が削除されていて，シンボリックリンクの相手先がないので，Internal Server Error が起こるでしょうし，後半は，参照先の「※注意事項」に書かれいてることのせいではないですか。</p>\n\n\n<ul id="bbp-reply-revision-log-210486" class="bbp-reply-revision-log">\n\n	<li id="bbp-reply-revision-log-210486-item-210487" class="bbp-reply-revision-log-item">\n		この返信は2 時間、 19 分前に <a href="https://ja.wordpress.org/support/users/o6asan/" title="o6asan のプロフィールを表示"><img alt='''' src=''https://secure.gravatar.com/avatar/6c5057823c023b611e38b2d139da90a5?s=14&#038;d=identicon&#038;r=g'' srcset=''https://secure.gravatar.com/avatar/6c5057823c023b611e38b2d139da90a5?s=28&amp;d=identicon&amp;r=g 2x'' class=''avatar avatar-14 photo'' height=''14'' width=''14'' /></a>&nbsp;<a href="https://ja.wordpress.org/support/users/o6asan/" title="o6asan のプロフィールを表示">o6asan</a> さんが編集しました。\n	</li>\n	<li id="bbp-reply-revision-log-210486-item-210488" class="bbp-reply-revision-log-item">\n		この返信は2 時間、 18 分前に <a href="https://ja.wordpress.org/support/users/o6asan/" title="o6asan のプロフィールを表示"><img alt='''' src=''https://secure.gravatar.com/avatar/6c5057823c023b611e38b2d139da90a5?s=14&#038;d=identicon&#038;r=g'' srcset=''https://secure.gravatar.com/avatar/6c5057823c023b611e38b2d139da90a5?s=28&amp;d=identicon&amp;r=g 2x'' class=''avatar avatar-14 phot