3%81%ae%e3%82%b5%e3%83%96%e3%83%89%e3%83%a1%e3%82%a4%e3%83%b3%e5%9e%8b%e3%81%ae%e3%83%9e%e3%83%ab%e3%83%81%e3%82%b5%e3%82%a4%e3%83%88%e3%81%ae/#post-210484";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 03 Nov 2016 00:06:02 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2993:"\n						\n						<p><a href="http://wpdocs.osdn.jp/%E3%83%8D%E3%83%83%E3%83%88%E3%83%AF%E3%83%BC%E3%82%AF%E3%81%AE%E4%BD%9C%E6%88%90#.E6.89.8B.E9.A0.863.EF.BC.9A_.E3.83.8D.E3.83.83.E3.83.88.E3.83.AF.E3.83.BC.E3.82.AF.E3.81.AE.E3.82.A4.E3.83.B3.E3.82.B9.E3.83.88.E3.83.BC.E3.83.AB" target="_blank" rel="nofollow">ネットワークの作成</a></p>\n<p><a href="http://bank.3cubed.info/%E3%82%A8%E3%83%83%E3%82%AF%E3%82%B9%E3%82%B5%E3%83%BC%E3%83%90%E3%83%BC%E3%81%A7%E3%82%B5%E3%83%96%E3%83%89%E3%83%A1%E3%82%A4%E3%83%B3%E5%9E%8B%E3%81%AE%E3%83%AF%E3%83%BC%E3%83%89%E3%83%97%E3%83%AC/" target="_blank" rel="nofollow">エックスサーバーでサブドメイン型のワードプレスマルチサイトを設定する方法</a></p>\n<p>を参考にサブドメイン型のマルチサイトを作ろうとしているのですが、サブドメインのサイトがエラーで表示されません。</p>\n<p>tatara1.com にワードプレスをインストール。<br />\nサブドメイン型でマルチサイト化。<br />\n1.tatara1.com、2.tatara1.comをサブドメインに追加。<br />\n1.tatara1.com、2.tatara1.comでサイト作成。</p>\n<blockquote><p>シンボリックリンクの作成作成されたサブドメイン名のディレクトリを削除するか、リネームをしてpublic_htmlディレクトリ直下にサブドメイン名でpublic_htmlとにシンボリックリンクを張ります。 </p></blockquote>\n<p>この部分がイマイチわからず、</p>\n<p>1.tatara1.comの方はサブドメイン追加時に作成されたサブドメイン名のディレクトリを削除しました。<br />\nInternal Server Errorが表示されます。</p>\n<p>2.tatara1.comの方はサブドメイン名のディレクトリの削除はしていません。<br />\n404エラーが表示されます。</p>\n<p>SSHは</p>\n<pre><code>cd  tatara1.com/public_html\nln -s tatara1.com/public_html ./1.tatara1.com</code></pre>\n<pre><code>cd  tatara1.com/public_html\nln -s tatara1.com/public_html ./2.tatara1.com</code></pre>\n<p>としております。</p>\n<p>何をどのようにすれば、<br />\nXサーバーでサブドメイン型のマルチサイトが作れるのでしょうか??</p>\n\n\n<ul id="bbp-topic-revision-log-210484" clas