82%8b%e3%83%9a%e3%83%bc%e3%82%b8%e3%82%92%e8%a1%a8/#post-210483";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 02 Nov 2016 15:48:26 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:207:"\n						\n						<p>ちなみにデフォルトであるTwenty SixteenでOvliver Cartをやってみたらページが遷移してくれました。やはりテーマが問題なようです。</p>\n						\n					";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:10:"ebifurai55";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:6;a:6:{s:4:"data";s:55:"\n					\n					\n					\n					\n					\n\n					\n\n					\n					\n				";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:151:"https://ja.wordpress.org/support/topic/%e5%85%a5%e5%8a%9b%e9%a0%85%e7%9b%ae%e3%82%92%e3%81%a7%e8%bf%bd%e5%8a%a0%e3%81%97%e3%81%9f%e3%81%84/#post-210482";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:34:"入力項目を+で追加したい";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:151:"https://ja.wordpress.org/support/topic/%e5%85%a5%e5%8a%9b%e9%a0%85%e7%9b%ae%e3%82%92%e3%81%a7%e8%bf%bd%e5%8a%a0%e3%81%97%e3%81%9f%e3%81%84/#post-210482";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 02 Nov 2016 14:53:45 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1547:"\n						\n						<p>管理ページの入力項目を追加ボタンで<br />\n次々追加し、次回入力する際は入力があれば表示させ、<br />\n次の順番を追加させたい</p>\n<p>1,2の入力があった場合<br />\n次回追加は3,4…と<br />\n前回入力の続きから追加出来るようにしたい<br />\n1を削除した場合、1,3,4…<br />\nみたいになるようにしたいです</p>\n<p>以下、現状では2回め（次回）入力の際<br />\n全て上書きになってしまいます</p>\n<pre><code>&lt;script&gt;\nvar num=1;\nfunction addrow(obj){\nvar n=obj.parentNode.parentNode.firstChild;\nvar flg=true;\nwhile(n){\nif(n.nodeName==&quot;DIV&quot;){flg=false; break;}\nn=n.nextSibling;\n}\nif(flg) return false;\nvar row=n.cloneNode(true);\nvar n=row.firstChild;\nvar flg=false;\nwhile(n){\nif(n.nodeName==&quot;#text&quot; &amp;&amp; n.nodeValue.match(/.*\\:/)){\nn.nodeValue=n.nodeValue.replace(/(.*)\\:/,&quot;$1&quot;+ num +&quot;:&quot;);\nflg=true;\n}\nn=n.nextSibling;\n}\nif(flg) num++;\nobj.parentNode.parentNode.insertBefore(row,document.getElementById(&#039;div_submit&#039;));\n}\n&lt;/script&gt;\n&lt;form method=&quot;post&quot; action=&quot;.&quot;&gt;\n&lt;div class=&quot;div1&quot;&gt;名前:&lt;input type=&quot;text&quot; name=&quot;name[]&quot;&gt;&lt;/div&gt;\n&lt;div id=&quot;div_submit&quot;&gt;&lt;input type=&quot;button&quot; value=&quot;追加&quot; onclick=&quot;addrow(this)&quot;&gt;&lt;/div&gt;\n&lt;input type=&quot;submit&quot; value=&quot;送信&quot;&gt;\n&lt;/form&gt;</code></pre>\n						\n					";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:8:"centos64";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:7;a:6:{s:4:"data";s:55:"\n					\n					\n					\n					\n					\n\n					\n\n					\n					\n				";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:162:"https://ja.wordpress.org/support/topic/%e3%83%97%e3%83%a9%e3%82%b0%e3%82%a4%e3%83%b3%e3%82%92%e6%8e%a2%e3%81%97%e3%81%a6%e3%81%84%e3%81%be%e3%81%99-2/#post-210481";s:7:"attribs";a:0:{