e3%83%97%e3%83%a9%e3%82%b0%e3%82%a4%e3%83%b3%e3%82%92%e6%8e%a2%e3%81%97%e3%81%a6%e3%81%84%e3%81%be%e3%81%99-2/#post-210480";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 02 Nov 2016 13:19:00 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:313:"\n						\n						<p>クリック一つで、1票を入れられるプラグインは、ありませんか？</p>\n<p>他人の書き込みに1票を入れられるプラグインで、何票獲得したかが、表示されるものです。</p>\n<p>ご存じの方、よろしくお願いします。</p>\n						\n					";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:9:"Tenzan188";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:9;a:6:{s:4:"data";s:55:"\n					\n					\n					\n					\n					\n\n					\n\n					\n					\n				";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:2:{s:0:"";a:5:{s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:169:"https://ja.wordpress.org/support/topic/%e6%8a%95%e7%a8%bf%e4%b8%80%e8%a6%a7%e3%82%92%e6%a8%aa%e4%b8%a6%e3%81%b3%e3%81%ab%e3%81%a7%e3%81%8d%e3%81%aa%e3%81%84/#post-210479";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:39:"投稿一覧を横並びにできない";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:169:"https://ja.wordpress.org/support/topic/%e6%8a%95%e7%a8%bf%e4%b8%80%e8%a6%a7%e3%82%92%e6%a8%aa%e4%b8%a6%e3%81%b3%e3%81%ab%e3%81%a7%e3%81%8d%e3%81%aa%e3%81%84/#post-210479";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 02 Nov 2016 11:23:47 +0000";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2115:"\n						\n						<p>投稿一覧ページを設けて、画像と日付、冒頭文をセットにして横並びにしようとしました。<br />\n以下のようにbook.php　テンプレートを作って　CSS　で横並びにしようとしたのですが、なぜか<br />\n縦並びになります。CSSはちゃんとリンクしています。間違っているところないように<br />\n思います。何が問題なのかわかりません。</p>\n<p>book.php<br />\n&lt;div id=&#8221;content&#8221; &gt;</p>\n<p>	&lt;?php query_posts(&#8216;post_type=blog&amp;posts_per_page=10&#8217;); ?&gt;<br />\n		&lt;?php if(have_posts()): while(have_posts()):<br />\nthe_post(); ?&gt;&lt;?php get_template_part(&#8216;content&#8217;,&#8217;excerpt&#8217;); ?&gt;</p>\n<p>&lt;?php endwhile; endif; ?&gt;<br />\n&lt;/div&gt;</p>\n<p>content-excerpt.php</p>\n<p>&lt;ul class=&#8221;ul_blog&#8221;&gt;</p>\n<li>\n&lt;table&gt;&lt;tr&gt;&lt;td rowspan=&#8221;3&#8243;&gt;<a>&#8220;&gt;<br />\n&lt;?php the_post_thumbnail(&#8216;small_thumbnail&#8217;); ?&gt;<br />\n</a><br />\n&lt;/td&gt;&lt;td&gt;<br />\n&lt;?php echo get_the_date(); ?&gt;<br />\n&lt;/td&gt;&lt;/tr&gt;<br />\n&lt;tr&gt;&lt;td&gt;<br />\n<a>&#8220;&gt;&lt;?php the_title(); ?&gt;</a><br />\n&lt;/td&gt;&lt;/tr&gt;<br />\n&lt;tr&gt;&lt;td&gt;<br />\n&lt;p class=&#8221;postcat&#8221;&gt;<br />\n&lt;?php the_category(&#8216; &#8216;); ?&gt;<br />\n&lt;?php echo get_the_term_list($post-&gt;ID, &#8216;blogcat&#8217;,&#8221;,&#8217; &#8216;); ?&gt;<br />\n&lt;/p&gt;<br />\n&lt;/td&gt;&lt;/tr&gt;<br />\n&lt;tr&gt;&lt;td colspan=&#8221;2&#8243;&gt;<br />\n&lt;p class=&#8221;more&#8221;&gt;<a>&#8220;&gt;&lt;?php the_excerpt(); ?&gt;<br />\n</a>&lt;/p&gt;<br />\n&lt;/td&gt;&lt;/tr&gt;<br />\n&lt;/table&gt;\n</li>\n<p>style.css</p>\n<p>/* ブログ */<br />\n.ul_blog  {<br />\n float: left !important;<br />\n list-style: none;<br />\n margin-left: 5px;<br />\n margin-right: 5px;<br />\n width: 350px;<br />\n }<br />\n.ul_blog li {<br />\n float: left !important;<br />\n list-style: none;<br />\n padding: 5px;<br />\n overflow: hidden;<br />\n}</p>\n<p>WordPress 3.8.16 </p>\n						\n					";s:7:"attr