(14390, 3976, 'カテゴリ_1_category_content_0_title', '●スーパーポリマー(多機能性下地剤)'),
(14391, 3976, '_カテゴリ_1_category_content_0_title', 'field_5808324599b35'),
(14392, 3976, 'カテゴリ_1_category_content_0_discription', '・スーパーポリマーF(モルタル・コンクリート用下地)\r\nシーラーレス塗装が可能で、モルタル・コンクリート面への塗り替えに適しています。\r\n・スーパーポリマーFA(サイディングボード用下地)\r\n浸透性が高く、窯業系サイディングボードの表面強化性・付着性に適しています。 '),
(14393, 3976, '_カテゴリ_1_category_content_0_discription', 'field_5808329799b36'),
(14394, 3976, 'カテゴリ_1_category_content_0_image', '3978'),
(14395, 3976, '_カテゴリ_1_category_content_0_image', 'field_5808322599b34'),
(14396, 3976, 'カテゴリ_1_category_content_1_title', '●シャインウォール21S(高耐久性複層仕上塗材)'),
(14397, 3976, '_カテゴリ_1_category_content_1_title', 'field_5808324599b35'),
(14398, 3976, 'カテゴリ_1_category_content_1_discription', '・自社オリジナルハイブリッドペイントシステム\r\n汚れ防止に有効な特殊セラミック成分、紫外線や雨などの劣化要因に強い特殊シリコン樹脂を採用しているので、長年綺麗な外壁を維持します。'),
(14399, 3976, '_カテゴリ_1_category_content_1_discription', 'field_5808329799b36'),
(14400, 3976, 'カテゴリ_1_category_content_1_image', '3983'),
(14401, 3976, '_カテゴリ_1_category_content_1_image', 'field_5808322599b34'),
(14402, 3976, 'カテゴリ_1_category_content_2_title', '●シャインエコルーフ21S(高耐久性屋根用遮熱塗料)'),
(14403, 3976, '_カテゴリ_1_category_content_2_title', 'field_5808324599b35'),
(14404, 3976, 'カテゴリ_1_category_content_2_discription', '・遮熱ポリマーシステム\r\n太陽光を反射することで、屋根表面の温度上昇を低減！省エネ・節電対策に有効です。また、遮熱ポリマーを上塗、下塗の二層に分けて塗装することで、上塗を透過した一部の赤外線も下塗りでブロック！ '),
(14405, 3976, '_カテゴリ_1_category_content_2_discription', 'field_5808329799b36'),
