(14845, 4018, '_カテゴリ_0_category_content_1_title', 'field_5808324599b35'),
(14846, 4018, 'カテゴリ_0_category_content_1_discription', 'これがスーパーポリマー工法の施工事例です。\r\n工事着工から約5～10日。\r\n手作業でムラなく、美しく、仕上げます。'),
(14847, 4018, '_カテゴリ_0_category_content_1_discription', 'field_5808329799b36'),
