(14855, 4018, '_カテゴリ_1_category_content_0_image', 'field_5808322599b34'),
(14856, 4018, 'カテゴリ_1_category_content_0_title', '●スーパーポリマー(多機能性下地剤)'),
(14857, 4018, '_カテゴリ_1_category_content_0_title', 'field_5808324599b35'),
(14858, 4018, 'カテゴリ_1_category_content_0_discription', '・スーパーポリマーF(モルタル・コンクリート用下地)\r\nシーラーレス塗装が可能で、モルタル・コンクリート面への塗り替えに適しています。\r\n・スーパーポリマーFA(サイディングボード用下地)\r\n浸透性が高く、窯業系サイディングボードの表面強化性・付着性に適しています。 '),
(14859, 4018, '_カテゴリ_1_category_content_0_discription', 'field_5808329799b36'),
(14860, 4018, 'カテゴリ_1_category_content_1_image', '3983'),
(14861, 4018, '_カテゴリ_1_category_content_1_image', 'field_5808322599b34'),
(14862, 4018, 'カテゴリ_1_category_content_1_title', '●シャインウォール21S(高耐久性複層仕上塗材)'),
(14863, 4018, '_カテゴリ_1_category_content_1_title', 'field_5808324599b35'),
(14864, 4018, 'カテゴリ_1_category_content_1_discription', '・自社オリジナルハイブリッドペイントシステム\r\n汚れ防止に有効な特殊セラミック成分、紫外線や雨などの劣化要因に強い特殊シリコン樹脂を採用しているので、長年綺麗な外壁を維持します。'),
(14865, 4018, '_カテゴリ_1_category_content_1_discription', 'field_5808329799b36'),
(14866, 4018, 'カテゴリ_1_category_content_2_image', '3982'),
(14867, 4018, '_カテゴリ_1_category_content_2_image', 'field_5808322599b34'),
(14868, 4018, 'カテゴリ_1_category_content_2_title', '●シャインエコルーフ21S(高耐久性屋根用遮熱塗料)'),
(14869, 4018, '_カテゴリ_1_category_content_2_title', 'field_5808324599b35'),
(14870, 4018, 'カテゴリ_1_category_content_2_discription', '・遮熱ポリマーシステム\r\n太陽光を反射することで、屋根表面の温度上昇を低減！省エネ・節電対策に有効です。また、遮熱ポリマーを上塗、下塗の二層に分けて塗装することで、上塗を透過した一部の赤外線も下塗りでブロック！ '),
