(15157, 4026, '_カテゴリ_1_category_name', 'field_5807d57dfe064'),
(15156, 4026, 'カテゴリ_1_category_name', '様々な問題を良い方向に導く…'),
(15155, 4026, '_カテゴリ_0_category_content', 'field_5807d5dffe066'),
(15154, 4026, 'カテゴリ_0_category_content', '2'),
(15153, 4026, '_カテゴリ_0_category_content_1_discription', 'field_5808329799b36'),
(15152, 4026, 'カテゴリ_0_category_content_1_discription', '(続き）\r\nきっかけは、アボリジニとの出逢い…\r\nガイドの案内で、シャーマンとの何気無い話しのなかで、あれは何？とガイドに聞いて貰ったら、あれが見えるのか？\r\nその時お前の名前は、ヴァーゴ　悩める人を救いなさい！\r\n此が始まりでした。\r\n\r\n私は、９月生まれで、乙女座?乙女座の事でした。\r\n運命的な出逢い、導きを感じ、様々な修行を経て、見えざる者との会話を行う事で、様々な問題をより良い道筋の光を見出だす手助けが使命なのです。'),
(15151, 4026, '_カテゴリ_0_category_content_1_title', 'field_5808324599b35'),
(15150, 4026, 'カテゴリ_0_category_content_1_title', '運命の出会い②'),
(15149, 4026, '_カテゴリ_0_category_content_1_image', 'field_5808322599b34'),
(15148, 4026, 'カテゴリ_0_category_content_1_image', '3989'),
(15147, 4026, '_カテゴリ_0_category_content_0_discription', 'field_5808329799b36'),
(15146, 4026, 'カテゴリ_0_category_content_0_discription', '子供の頃から　あの人誰？誰も居ないや無いの？又誰か何か言っているよ？何も聞こえないよ！\r\nこの様な時、祖母だけは、何も心配要らん。婆ちゃんはユタと言って私もあんたと同じやった。生まれつきやから大丈夫。\r\n私には、理解出来ませんでした。\r\n\r\nきっかけは、アボリジニとの出逢い…　（続く）'),
(15145, 4026, '_カテゴリ_0_category_content_0_title', 'field_5808324599b35'),
(15144, 4026, 'カテゴリ_0_category_content_0_title', '運命の出会い①'),
