(19101, 4618, 'categories_0_category_content_0_discription', 'ダイエットや健康に効果的だけど、買うと１本７０００円以上する高価な「酵素ジュース」を簡単に手作りしてみませんか？\r\n\r\n参加費は、材料代全て込みで4000円です '),
