(19118, 4618, '_categories_1_category_content_0_title', 'field_5808324599b35'),
(19119, 4618, 'categories_1_category_content_0_discription', '人間にとって非常に大切な『酵素』の優位性に着目し、酵素を取り入れた『酵素生活』\r\nを一緒に普及しましょう♪ 『酵素ジュース作り』と『酵素生活』『酵素ダイエット（ファスティング）』の\r\n正しい知識と実践法を習得し、 第三者に対してカウンセリングができるます！\r\n\r\n『楽しく学べて細胞から元気になり、 美しく、そして健康になれる』そんな素晴らしいアドバイザー資格です。 '),
