(19124, 4618, '_categories_1_category_content_1_title', 'field_5808324599b35'),
(19125, 4618, 'categories_1_category_content_1_discription', '酵素ジュース作りの教え方、酵素栄養学、酵素を使った正しいダイエット（ファスティング）法を楽しく学び\r\n\r\n健康教室を開けるアドバイザー資格です♪\r\n\r\n◎酵素ジュースアドバイザー\r\n1日（3時間）　21,600円\r\n+　実技の材料費4,000円　　\r\n合計25,600円（税込み）\r\n※認定書込みの金額です。\r\n\r\n\r\n【受講時間】 ライフスタイルに合わせて、ご希望のお時間での受講が可能です。 \r\n○1dayコース（3h） 　'),
