(19317, 4644, 'categories_0_category_content_0_title', '酵素ジュース'),
(19318, 4644, '_categories_0_category_content_0_title', 'field_5808324599b35'),
(19319, 4644, 'categories_0_category_content_0_discription', 'ダイエットや健康に効果的だけど、買うと１本７０００円以上する高価な「酵素ジュース」を簡単に手作りしてみませんか？\r\n\r\n参加費は、材料代全て込みで4000円です '),
(19320, 4644, '_categories_0_category_content_0_discription', 'field_5808329799b36'),
(19321, 4644, 'categories_0_category_content_1_image', '4631'),
(19322, 4644, '_categories_0_category_content_1_image', 'field_5808322599b34'),
(19323, 4644, 'categories_0_category_content_1_title', '酵素とは'),
(19324, 4644, '_categories_0_category_content_1_title', 'field_5808324599b35'),
(19325, 4644, 'categories_0_category_content_1_discription', '酵素は「命のろうそく」と言われるほど、体にとって大切なもので、 生命活動の全てに関わっています。\r\n\r\n一生のうち体で作られる体内酵素の量は決まっています。\r\n\r\n２０代をピークに次第に作られる量が減り始め、４０代からは急激に減りだします。\r\n\r\n体内酵素（潜在酵素）は食物を消化・吸収する消化酵素と体の新陳代謝を司る代謝酵素に分かれます。'),
(19326, 4644, '_categories_0_category_content_1_discription', 'field_5808329799b36'),
(19327, 4644, 'categories_0_category_content', '2'),
(19328, 4644, '_categories_0_category_content', 'field_5807d5dffe066'),
(19329, 4644, 'categories_1_category_name', 'アドバイザー資格'),
(19330, 4644, '_categories_1_category_name', 'field_5807d57dfe064'),
(19331, 4644, 'categories_1_hide_flg', ''),
(19332, 4644, '_categories_1_hide_flg', 'field_5807d59cfe065'),
(19333, 4644, 'categories_1_category_content_0_image', '4633'),
(19334, 4644, '_categories_1_category_content_0_image', 'field_5808322599b34'),
(19335, 4644, 'categories_1_category_content_0_title', 'アドバイサー資格'),
(19336, 4644, '_categories_1_category_content_0_title', 'field_5808324599b35'),
(19337, 4644, 'categories_1_category_content_0_discription', '人間にとって非常に大切な『酵素』の優位性に着目し、酵素を取り入れた『酵素生活』\r\nを一緒に普及しましょう♪ 『酵素ジュース作り』と『酵素生活』『酵素ダイエット（ファスティング）』の\r\n正しい知識と実践法を習得し、 第三者に対してカウンセリングができるます！\r\n\r\n『楽しく学べて細胞から元気になり、 美しく、そして健康になれる』そんな素晴らしいアドバイザー資格です。 '),
(19338, 4644, '_categories_1_category_content_0_discription', 'field_5808329799b36'),
(19339, 4644, 'categories_1_category_content_1_image', '4635'),
(19340, 4644, '_categories_1_category_content_1_image', 'field_5808322599b34'),
(19341, 4644, 'categories_1_category_content_1_title', 'アドバイザー資格'),
(19342, 4644, '_categories_1_category_content_1_title', 'field_5808324599b35'),
(19343, 4644, 'categories_1_category_content_1_discription', '酵素ジュース作りの教え方、酵素栄養学、酵素を使った正しいダイエット（ファスティング）法を楽しく学び\r\n\r\n健康教室を開けるアドバイザー資格です♪\r\n\r\n◎酵素ジュースアドバイザー\r\n1日（3時間）　21,600円\r\n+　実技の材料費4,000円　　\r\n合計25,600円（税込み）\r\n※認定書込みの金額です。\r\n\r\n\r\n【受講時間】 ライフスタイルに合わせて、ご希望のお時間での受講が可能です。 \r\n○1dayコース（3h） 　'),
(19344, 4644, '_categories_1_category_content_1_discription', 'field_5808329799b36'),
(19345, 4644, 'categories_1_category_content_2_image', '4638'),
(19346, 4644, '_categories_1_category_content_2_image', 'field_5808322599b34'),
(19347, 4644, 'categories_1_category_content_2_title', 'コラボ企画も募集中！'),
(19348, 4644, '_categories_1_category_content_2_title', 'field_5808324599b35'),
(19349, 4644, 'categories_1_category_content_2_discription', '酵素生活を広めてみませんか？\r\n\r\n企業様やサロン様にお邪魔して、出張酵素ジュース教室もできます\r\n\r\n楽しく酵素生活を広げましょう♪\r\n\r\n\r\nまた、酵素ファスティングなどの知識もお伝えしますので\r\nダイエットや健康に興味がある人も大満足な内容になっています！\r\n'),
