(19848, 4664, '_categories_0_category_content_1_image', 'field_5808322599b34'),
(19849, 4664, 'categories_0_category_content_1_title', '酵素とは'),
(19850, 4664, '_categories_0_category_content_1_title', 'field_5808324599b35'),
(19851, 4664, 'categories_0_category_content_1_discription', '酵素は「命のろうそく」と言われるほど、体にとって大切なもので、 生命活動の全てに関わっています。\r\n\r\n一生のうち体で作られる体内酵素の量は決まっています。\r\n\r\n２０代をピークに次第に作られる量が減り始め、４０代からは急激に減りだします。\r\n\r\n体内酵素（潜在酵素）は食物を消化・吸収する消化酵素と体の新陳代謝を司る代謝酵素に分かれます。'),
(19852, 4664, '_categories_0_category_content_1_discription', 'field_5808329799b36'),
(19853, 4664, 'categories_0_category_content', '2'),
(19854, 4664, '_categories_0_category_content', 'field_5807d5dffe066'),
(19855, 4664, 'categories_1_category_name', 'アドバイザー資格'),
(19856, 4664, '_categories_1_category_name', 'field_5807d57dfe064'),
(19857, 4664, 'categories_1_hide_flg', ''),
(19858, 4664, '_categories_1_hide_flg', 'field_5807d59cfe065'),
(19859, 4664, 'categories_1_category_content_0_image', '4633'),
(19860, 4664, '_categories_1_category_content_0_image', 'field_5808322599b34'),
(19861, 4664, 'categories_1_category_content_0_title', 'アドバイサー資格'),
(19862, 4664, '_categories_1_category_content_0_title', 'field_5808324599b35'),
(19863, 4664, 'categories_1_category_content_0_discription', '人間にとって非常に大切な『酵素』の優位性に着目し、酵素を取り入れた『酵素生活』\r\nを一緒に普及しましょう♪ 『酵素ジュース作り』と『酵素生活』『酵素ダイエット（ファスティング）』の\r\n正しい知識と実践法を習得し、 第三者に対してカウンセリングができるます！\r\n\r\n『楽しく学べて細胞から元気になり、 美しく、そして健康になれる』そんな素晴らしいアドバイザー資格です。 '),
(19864, 4664, '_categories_1_category_content_0_discription', 'field_5808329799b36'),
(19865, 4664, 'categories_1_category_content_1_image', '4635'),
(19866, 4664, '_categories_1_category_content_1_image', 'field_5808322599b34'),
(19867, 4664, 'categories_1_category_content_1_title', 'アドバイザー資格'),
(19868, 4664, '_categories_1_category_content_1_title', 'field_5808324599b35'),
(19869, 4664, 'categories_1_category_content_1_discription', '酵素ジュース作りの教え方、酵素栄養学、酵素を使った正しいダイエット（ファスティング）法を楽しく学び\r\n\r\n健康教室を開けるアドバイザー資格です♪\r\n\r\n◎酵素ジュースアドバイザー\r\n1日（3時間）　21,600円\r\n+　実技の材料費4,000円　　\r\n合計25,600円（税込み）\r\n※認定書込みの金額です。\r\n\r\n\r\n【受講時間】 ライフスタイルに合わせて、ご希望のお時間での受講が可能です。 \r\n○1dayコース（3h） 　'),
(19870, 4664, '_categories_1_category_content_1_discription', 'field_5808329799b36'),
(19871, 4664, 'categories_1_category_content_2_image', '4638'),
(19872, 4664, '_categories_1_category_content_2_image', 'field_5808322599b34'),
(19873, 4664, 'categories_1_category_content_2_title', 'コラボ企画も募集中！'),
(19874, 4664, '_categories_1_category_content_2_title', 'field_5808324599b35'),
(19875, 4664, 'categories_1_category_content_2_discription', '酵素生活を広めてみませんか？\r\n\r\n企業様やサロン様にお邪魔して、出張酵素ジュース教室もできます\r\n\r\n楽しく酵素生活を広げましょう♪\r\n\r\n\r\nまた、酵素ファスティングなどの知識もお伝えしますので\r\nダイエットや健康に興味がある人も大満足な内容になっています！\r\n'),
(19876, 4664, '_categories_1_category_content_2_discription', 'field_5808329799b36'),
(19877, 4664, 'categories_1_category_content', '3'),
(19878, 4664, '_categories_1_category_content', 'field_5807d5dffe066');
