(19881, 4664, 'appearance_0_comment', '開催日時は、Facebook、LINE@,ブログにてお知らせします。所要時間は2時間です。\r\n\r\n毎月、4回ほど開催しています。\r\n\r\n参加費　4,000円\r\n（季節のフルーツ・甜菜糖・容器など含む）\r\n持ち物 エコバッグ等（酵素ジュースなどを持ち帰る為のカバン）\r\nレッスンの流れ ・酵素の基礎知識 ・酵素ジュース作り\r\n\r\nお問い合わせ：070-5537-0055（杉村）\r\n教室開催中は出れません。後ほどかけ直します！\r\n'),
