(20074, 4665, 'appearance_0_comment', '【４月７日グランドオープン！！】\r\n\r\nワンちゃん達に　いつもキレイに健康でいてもらいたいと願い、\r\nリーズナブルで通いやすい設定のサロンにしたいとの思いで\r\n「SINAMON}をオープンしました。\r\n\r\n一人でやってますので『予約優先』の営業です。\r\n末長くよろしくお願いします！'),
