(20299, 4667, '_categories_0_category_content_0_title', 'field_5808324599b35'),
(20300, 4667, 'categories_0_category_content_0_discription', 'ダイエットや健康に効果的だけど、買うと１本７０００円以上する高価な「酵素ジュース」を簡単に手作りしてみませんか？\r\n\r\n参加費は、材料代全て込みで4000円です '),
(20301, 4667, '_categories_0_category_content_0_discription', 'field_5808329799b36'),
(20302, 4667, 'categories_0_category_content_1_image', '4631'),
(20303, 4667, '_categories_0_category_content_1_image', 'field_5808322599b34'),
(20304, 4667, 'categories_0_category_content_1_title', '酵素とは'),
(20305, 4667, '_categories_0_category_content_1_title', 'field_5808324599b35'),
(20306, 4667, 'categories_0_category_content_1_discription', '酵素は「命のろうそく」と言われるほど、体にとって大切なもので、 生命活動の全てに関わっています。\r\n\r\n一生のうち体で作られる体内酵素の量は決まっています。\r\n\r\n２０代をピークに次第に作られる量が減り始め、４０代からは急激に減りだします。\r\n\r\n体内酵素（潜在酵素）は食物を消化・吸収する消化酵素と体の新陳代謝を司る代謝酵素に分かれます。'),
(20307, 4667, '_categories_0_category_content_1_discription', 'field_5808329799b36'),
(20308, 4667, 'categories_0_category_content', '2'),
(20309, 4667, '_categories_0_category_content', 'field_5807d5dffe066'),
(20310, 4667, 'categories_1_category_name', 'アドバイザー資格'),
(20311, 4667, '_categories_1_category_name', 'field_5807d57dfe064'),
(20312, 4667, 'categories_1_hide_flg', ''),
(20313, 4667, '_categories_1_hide_flg', 'field_5807d59cfe065'),
(20314, 4667, 'categories_1_category_content_0_image', '4633'),
(20315, 4667, '_categories_1_category_content_0_image', 'field_5808322599b34'),
(20316, 4667, 'categories_1_category_content_0_title', 'アドバイサー資格'),
(20317, 4667, '_categories_1_category_content_0_title', 'field_5808324599b35'),
(20318, 4667, 'categories_1_category_content_0_discription', '人間にとって非常に大切な『酵素』の優位性に着目し、酵素を取り入れた『酵素生活』\r\nを一緒に普及しましょう♪ 『酵素ジュース作り』と『酵素生活』『酵素ダイエット（ファスティング）』の\r\n正しい知識と実践法を習得し、 第三者に対してカウンセリングができるます！\r\n\r\n『楽しく学べて細胞から元気になり、 美しく、そして健康になれる』そんな素晴らしいアドバイザー資格です。 '),
(20319, 4667, '_categories_1_category_content_0_discription', 'field_5808329799b36'),
(20320, 4667, 'categories_1_category_content_1_image', '4635'),
(20321, 4667, '_categories_1_category_content_1_image', 'field_5808322599b34'),
(20322, 4667, 'categories_1_category_content_1_title', 'アドバイザー資格'),
(20323, 4667, '_categories_1_category_content_1_title', 'field_5808324599b35'),
(20324, 4667, 'categories_1_category_content_1_discription', '酵素ジュース作りの教え方、酵素栄養学、酵素を使った正しいダイエット（ファスティング）法を楽しく学び\r\n\r\n健康教室を開けるアドバイザー資格です♪\r\n\r\n◎酵素ジュースアドバイザー\r\n1日（3時間）　21,600円\r\n+　実技の材料費4,000円　　\r\n合計25,600円（税込み）\r\n※認定書込みの金額です。\r\n\r\n\r\n【受講時間】 ライフスタイルに合わせて、ご希望のお時間での受講が可能です。 \r\n○1dayコース（3h） 　'),
(20325, 4667, '_categories_1_category_content_1_discription', 'field_5808329799b36'),
(20326, 4667, 'categories_1_category_content_2_image', '4638'),
(20327, 4667, '_categories_1_category_content_2_image', 'field_5808322599b34'),
(20328, 4667, 'categories_1_category_content_2_title', 'コラボ企画も募集中！'),
(20329, 4667, '_categories_1_category_content_2_title', 'field_5808324599b35'),
(20330, 4667, 'categories_1_category_content_2_discription', '酵素生活を広めてみませんか？\r\n\r\n企業様やサロン様にお邪魔して、出張酵素ジュース教室もできます\r\n\r\n楽しく酵素生活を広げましょう♪\r\n\r\n\r\nまた、酵素ファスティングなどの知識もお伝えしますので\r\nダイエットや健康に興味がある人も大満足な内容になっています！\r\n'),
(20331, 4667, '_categories_1_category_content_2_discription', 'field_5808329799b36'),
(20332, 4667, 'categories_1_category_content', '3'),
(20333, 4667, '_categories_1_category_content', 'field_5807d5dffe066'),
(20334, 4667, 'appearance_0_title', '教室について'),
(20335, 4667, '_appearance_0_title', 'field_58181ebe7c19a'),
(20336, 4667, 'appearance_0_comment', '開催日時は、Facebook、LINE@,ブログにてお知らせします。所要時間は2時間です。\r\n\r\n毎月、4回ほど開催しています。\r\n\r\n参加費　4,000円\r\n（季節のフルーツ・甜菜糖・容器など含む）\r\n持ち物 エコバッグ等（酵素ジュースなどを持ち帰る為のカバン）\r\nレッスンの流れ ・酵素の基礎知識 ・酵素ジュース作り\r\n\r\nお問い合わせ：070-5537-0055（杉村）\r\n教室開催中は出れません。後ほどかけ直します！\r\n'),
