(20466, 4668, 'categories_1_category_content_2_discription', 'トリミングはもちろん、預かりにも来てくれるシーズーの清水るるチャン（＾ν＾）仕草がとても可愛いく、他のワンコを触るとヤキモチを妬いてくれます（≧∇≦）\r\n外を通る人にも超アピールします❗️近くの高校生が\r\n可愛いって言ってくれるのが嬉しいみたいですよ(^ー゜) '),
