(21017, 4690, 'categories_0_category_content_0_title', 'フィリピン産オーガニックココナッツを使用'),
(21018, 4690, '_categories_0_category_content_0_title', 'field_5808324599b35'),
(21019, 4690, 'categories_0_category_content_0_discription', 'フィリピンは、ココナッツの輸出量が世界１、２位を争うほどの国です。また、ココナッツ庁という政府機関もあり、農家や生産者への技術支援や、品質管理の指導を行っており、インドネシア・スリランカ・タイやそのほかの国と比べて、ココナッツオイルの品質が高いことで知られています。\r\nココナチュールは、そんなフィリピン ケソン州の昔ながらの土地で薬剤を一切使わず育てられた有機ココナッツを使用しています。 '),
(21020, 4690, '_categories_0_category_content_0_discription', 'field_5808329799b36'),
(21021, 4690, 'categories_0_category_content', '1'),
(21022, 4690, '_categories_0_category_content', 'field_5807d5dffe066'),
(21023, 4690, 'categories_1_category_name', '抽出法にこだわった低温圧搾法'),
(21024, 4690, '_categories_1_category_name', 'field_5807d57dfe064'),
(21025, 4690, 'categories_1_hide_flg', ''),
(21026, 4690, '_categories_1_hide_flg', 'field_5807d59cfe065'),
(21027, 4690, 'categories_1_category_content_0_image', '4683'),
(21028, 4690, '_categories_1_category_content_0_image', 'field_5808322599b34'),
(21029, 4690, 'categories_1_category_content_0_title', '成分を無駄なく抽出する低温圧搾（Cold-press）法'),
(21030, 4690, '_categories_1_category_content_0_title', 'field_5808324599b35'),
(21031, 4690, 'categories_1_category_content_0_discription', 'フィリピンでオーガニック認定された有機ココナッツを、無精製・無漂白・無添加・コールドプレス製法（熱処理を行わないので、成分や香りを損なうことなく採取される）で、抽出しています。\r\n一般的な精製ココナッツオイルは、高温で作られ漂白や脱臭を加えています。当然、ココナッツの香りがありません。また、ココナッツ果実も乾燥果実を使うことが多く大量生産が可能なため、価格も抑えられます。 '),
(21032, 4690, '_categories_1_category_content_0_discription', 'field_5808329799b36'),
(21033, 4690, 'categories_1_category_content', '1'),
(21034, 4690, '_categories_1_category_content', 'field_5807d5dffe066'),
(21035, 4690, 'categories_2_category_name', '日本への輸送方法も、こだわっています'),
(21036, 4690, '_categories_2_category_name', 'field_5807d57dfe064'),
(21037, 4690, 'categories_2_hide_flg', ''),
(21038, 4690, '_categories_2_hide_flg', 'field_5807d59cfe065'),
(21039, 4690, 'categories_2_category_content_0_image', '4684'),
(21040, 4690, '_categories_2_category_content_0_image', 'field_5808322599b34'),
(21041, 4690, 'categories_2_category_content_0_title', 'なぜコストがかかる輸送方法を選ぶのか'),
(21042, 4690, '_categories_2_category_content_0_title', 'field_5808324599b35'),
(21043, 4690, 'categories_2_category_content_0_discription', '通常日本で販売されているココナッツオイルは、船便で３週間ほど掛けて日本へ輸入しています。\r\n船便の輸送は、高温多湿の船底に積まれることが多く、せっかくのエキストラバージンココナッツオイルが、長期間劣悪な環境下にさらされてしまいます。\r\n弊社のココナチュールは輸送時間も早い航空便を利用しており、空を使うことで逆に商品が冷やされ、この商品を運ぶ上で最も適していると思われる輸送方法です。 '),
(21044, 4690, '_categories_2_category_content_0_discription', 'field_5808329799b36'),
(21045, 4690, 'categories_2_category_content', '1'),
(21046, 4690, '_categories_2_category_content', 'field_5807d5dffe066'),
(21047, 4690, 'appearance_0_title', 'メッセージ・ サービス・ イベント'),
(21048, 4690, '_appearance_0_title', 'field_58181ebe7c19a'),
(21049, 4690, 'appearance_0_comment', 'COCONatureは、フィリピンのオーガニック認証農園で厳正な基準の元に有機栽培されたココナッツを使用。\r\n\r\nBFAD）の食品・薬品の安全基準に関する認可を得た清潔な工場で低温圧搾し、伝統的な発酵分離法でじっくり時間をかけ丁寧に抽出した、無漂白・無添加の食用ココナッツオイルです。\r\n\r\nフィリピンの政府機関「ココナッツ庁」にて正式な輸入手続きを行い、認可を受けた商品ですので安心してお召し上がりいただけます。'),
