(21388, 4675, '_categories_2_category_content_1_discription', 'field_5808329799b36'),
(21387, 4675, 'categories_2_category_content_1_discription', '成人、ご就職、ご結婚、厄除けのお祝いに花珠真珠、\r\n法事などのお悔やみの席に黒蝶真珠をおすすめいたします。\r\n\r\nどちらもフォーマルのシーンにはかかせないもの。\r\n\r\n昔から変わることないデザインは、どの世代の方にも、どんなタイプの\r\n方が着けても襟元をきれいに飾ってくれます。\r\n\r\n人生の節目の時にお母様からお嬢様へのプレゼントにいかがでしょうか。\r\n'),
(21386, 4675, '_categories_2_category_content_1_title', 'field_5808324599b35'),
(21385, 4675, 'categories_2_category_content_1_title', '最高級真珠　花珠真珠と黒蝶真珠'),
