(21383, 4675, 'categories_2_category_content_1_image', '4700'),
(21382, 4675, '_categories_2_category_content_0_discription', 'field_5808329799b36'),
(21381, 4675, 'categories_2_category_content_0_discription', 'ピンクゴールドとホワイトゴールドを使った遥ならではのデザイン。\r\n\r\n画像のリングは、幅が4mmのデザインです。\r\n\r\n少し太めの6ミリ幅のリングもございます。\r\n\r\n細身なので、着けやすいです。\r\nホワイトゴールドとピンクゴールドの組み合わせが優しい印象を与えます。'),
