(21750, 4716, 'categories_0_category_content_0_discription', 'スポーツサングラス『OAKLEY』の度付きに特化しています。\r\nオークリーの度付きをご検討の方、ぜひ一度ご相談ください☆\r\nブログ：オークリーの度付きができるお店\r\nＦＢページ：オークリーの度付きができるお店 ヨシダ\r\n随時更新中!! '),
