(21760, 4716, 'categories_0_category_content_2_title', 'lafont　ラフォン'),
(21761, 4716, '_categories_0_category_content_2_title', 'field_5808324599b35'),
(21762, 4716, 'categories_0_category_content_2_discription', '彩り豊かなフレンチデザインがメガネを楽しくしてくれます。\r\nラフォンの魅力をご紹介したブログ☆\r\nヨシダスタッフブログをぜひご覧ください♪\r\n'),
