(21772, 4716, 'categories_1_category_content_0_title', 'アイスウォッチ'),
(21773, 4716, '_categories_1_category_content_0_title', 'field_5808324599b35'),
(21774, 4716, 'categories_1_category_content_0_discription', '2007年、ベルギー発のファッションウォッチ「アイスウォッチ」。\r\n\r\n世界100カ国以上の国と地域で販売されています。\r\n海外セレブから国内の芸能人にも多数愛用されています。\r\n\r\n多彩な色とユニークな素材を使い、高品質ながらお求め\r\nやすい価格なのも魅力の一つです。'),
(21775, 4716, '_categories_1_category_content_0_discription', 'field_5808329799b36'),
(21776, 4716, 'categories_1_category_content_1_image', '4695'),
(21777, 4716, '_categories_1_category_content_1_image', 'field_5808322599b34'),
(21778, 4716, 'categories_1_category_content_1_title', 'セイコールキア'),
(21779, 4716, '_categories_1_category_content_1_title', 'field_5808324599b35'),
(21780, 4716, 'categories_1_category_content_1_discription', 'セイコー ルキアは、前向きに自分らしく生きていく女性たちを輝かせるウオッチ。高機能とスマートなデザインをあわせ持ち、たくさんの女性たちに支持されています。\r\n\r\n他にもブライツ、グランドセイコーなどセイコーのほとんどの商品を取り扱っています。 '),
(21781, 4716, '_categories_1_category_content_1_discription', 'field_5808329799b36'),
(21782, 4716, 'categories_1_category_content_2_image', '4696'),
(21783, 4716, '_categories_1_category_content_2_image', 'field_5808322599b34'),
(21784, 4716, 'categories_1_category_content_2_title', 'シチズン　クロスシー'),
(21785, 4716, '_categories_1_category_content_2_title', 'field_5808324599b35'),
(21786, 4716, 'categories_1_category_content_2_discription', '軽く、肌にやさしく、美しい。\r\nクロスシーが磨き上げた、洗練のチタニウムモデル。\r\n圧倒的な軽さと小ぶりサイズな上に、定期的な電池交換も時刻合わせもいらない、エコ・ドライブ電波時計を搭載。\r\n他にも、カンパノラ、アテッサ、エクシード、ウィッカなどほとんどの商品を取り扱っています。 \r\n'),
(21787, 4716, '_categories_1_category_content_2_discription', 'field_5808329799b36'),
(21788, 4716, 'categories_1_category_content', '3'),
(21789, 4716, '_categories_1_category_content', 'field_5807d5dffe066'),
