(21795, 4716, '_categories_2_category_content_0_image', 'field_5808322599b34'),
(21796, 4716, 'categories_2_category_content_0_title', 'マリッジリング『遥』'),
(21797, 4716, '_categories_2_category_content_0_title', 'field_5808324599b35'),
(21798, 4716, 'categories_2_category_content_0_discription', 'ピンクゴールドとホワイトゴールドを使った遥ならではのデザイン。\r\n\r\n画像のリングは、幅が4mmのデザインです。\r\n\r\n少し太めの6ミリ幅のリングもございます。\r\n\r\n細身なので、着けやすいです。\r\nホワイトゴールドとピンクゴールドの組み合わせが優しい印象を与えます。'),
(21799, 4716, '_categories_2_category_content_0_discription', 'field_5808329799b36'),
(21800, 4716, 'categories_2_category_content_1_image', '4700'),
(21801, 4716, '_categories_2_category_content_1_image', 'field_5808322599b34'),
(21802, 4716, 'categories_2_category_content_1_title', '最高級真珠　花珠真珠と黒蝶真珠'),
(21803, 4716, '_categories_2_category_content_1_title', 'field_5808324599b35'),
(21804, 4716, 'categories_2_category_content_1_discription', '成人、ご就職、ご結婚、厄除けのお祝いに花珠真珠、\r\n法事などのお悔やみの席に黒蝶真珠をおすすめいたします。\r\n\r\nどちらもフォーマルのシーンにはかかせないもの。\r\n\r\n昔から変わることないデザインは、どの世代の方にも、どんなタイプの\r\n方が着けても襟元をきれいに飾ってくれます。\r\n\r\n人生の節目の時にお母様からお嬢様へのプレゼントにいかがでしょうか。\r\n'),
(21805, 4716, '_categories_2_category_content_1_discription', 'field_5808329799b36'),
(21806, 4716, 'categories_2_category_content_2_image', ''),
(21807, 4716, '_categories_2_category_content_2_image', 'field_5808322599b34'),
