(21907, 4717, '_categories_0_category_content_2_image', 'field_5808322599b34'),
(21908, 4717, 'categories_0_category_content_2_title', 'lafont　ラフォン'),
(21909, 4717, '_categories_0_category_content_2_title', 'field_5808324599b35'),
(21910, 4717, 'categories_0_category_content_2_discription', '彩り豊かなフレンチデザインがメガネを楽しくしてくれます。\r\nラフォンの魅力をご紹介したブログ☆\r\nヨシダスタッフブログをぜひご覧ください♪\r\n'),
