(21919, 4717, '_categories_1_category_content_0_image', 'field_5808322599b34'),
(21920, 4717, 'categories_1_category_content_0_title', 'アイスウォッチ'),
(21921, 4717, '_categories_1_category_content_0_title', 'field_5808324599b35'),
(21922, 4717, 'categories_1_category_content_0_discription', '2007年、ベルギー発のファッションウォッチ「アイスウォッチ」。\r\n\r\n世界100カ国以上の国と地域で販売されています。\r\n海外セレブから国内の芸能人にも多数愛用されています。\r\n\r\n多彩な色とユニークな素材を使い、高品質ながらお求め\r\nやすい価格なのも魅力の一つです。'),
(21923, 4717, '_categories_1_category_content_0_discription', 'field_5808329799b36'),
(21924, 4717, 'categories_1_category_content_1_image', '4695'),
(21925, 4717, '_categories_1_category_content_1_image', 'field_5808322599b34'),
(21926, 4717, 'categories_1_category_content_1_title', 'セイコールキア'),
(21927, 4717, '_categories_1_category_content_1_title', 'field_5808324599b35'),
(21928, 4717, 'categories_1_category_content_1_discription', 'セイコー ルキアは、前向きに自分らしく生きていく女性たちを輝かせるウオッチ。高機能とスマートなデザインをあわせ持ち、たくさんの女性たちに支持されています。\r\n\r\n他にもブライツ、グランドセイコーなどセイコーのほとんどの商品を取り扱っています。 '),
(21929, 4717, '_categories_1_category_content_1_discription', 'field_5808329799b36'),
(21930, 4717, 'categories_1_category_content_2_image', '4696'),
(21931, 4717, '_categories_1_category_content_2_image', 'field_5808322599b34'),
(21932, 4717, 'categories_1_category_content_2_title', 'シチズン　クロスシー'),
(21933, 4717, '_categories_1_category_content_2_title', 'field_5808324599b35'),
(21934, 4717, 'categories_1_category_content_2_discription', '軽く、肌にやさしく、美しい。\r\nクロスシーが磨き上げた、洗練のチタニウムモデル。\r\n圧倒的な軽さと小ぶりサイズな上に、定期的な電池交換も時刻合わせもいらない、エコ・ドライブ電波時計を搭載。\r\n他にも、カンパノラ、アテッサ、エクシード、ウィッカなどほとんどの商品を取り扱っています。 \r\n'),
(21935, 4717, '_categories_1_category_content_2_discription', 'field_5808329799b36'),
(21936, 4717, 'categories_1_category_content', '3'),
(21937, 4717, '_categories_1_category_content', 'field_5807d5dffe066'),
(21938, 4717, 'categories_2_category_name', '●宝石／マリッジリング／宝石リフォーム'),
(21939, 4717, '_categories_2_category_name', 'field_5807d57dfe064'),
(21940, 4717, 'categories_2_hide_flg', ''),
(21941, 4717, '_categories_2_hide_flg', 'field_5807d59cfe065'),
(21942, 4717, 'categories_2_category_content_0_image', '4698'),
(21943, 4717, '_categories_2_category_content_0_image', 'field_5808322599b34'),
(21944, 4717, 'categories_2_category_content_0_title', 'マリッジリング『遥』'),
(21945, 4717, '_categories_2_category_content_0_title', 'field_5808324599b35'),
(21946, 4717, 'categories_2_category_content_0_discription', 'ピンクゴールドとホワイトゴールドを使った遥ならではのデザイン。\r\n\r\n画像のリングは、幅が4mmのデザインです。\r\n\r\n少し太めの6ミリ幅のリングもございます。\r\n\r\n細身なので、着けやすいです。\r\nホワイトゴールドとピンクゴールドの組み合わせが優しい印象を与えます。'),
(21947, 4717, '_categories_2_category_content_0_discription', 'field_5808329799b36'),
(21948, 4717, 'categories_2_category_content_1_image', '4700'),
(21949, 4717, '_categories_2_category_content_1_image', 'field_5808322599b34'),
(21950, 4717, 'categories_2_category_content_1_title', '最高級真珠　花珠真珠と黒蝶真珠'),
(21951, 4717, '_categories_2_category_content_1_title', 'field_5808324599b35'),
(21952, 4717, 'categories_2_category_content_1_discription', '成人、ご就職、ご結婚、厄除けのお祝いに花珠真珠、\r\n法事などのお悔やみの席に黒蝶真珠をおすすめいたします。\r\n\r\nどちらもフォーマルのシーンにはかかせないもの。\r\n\r\n昔から変わることないデザインは、どの世代の方にも、どんなタイプの\r\n方が着けても襟元をきれいに飾ってくれます。\r\n\r\n人生の節目の時にお母様からお嬢様へのプレゼントにいかがでしょうか。\r\n'),
(21953, 4717, '_categories_2_category_content_1_discription', 'field_5808329799b36'),
(21954, 4717, 'categories_2_category_content_2_image', ''),
(21955, 4717, '_categories_2_category_content_2_image', 'field_5808322599b34'),
(21956, 4717, 'categories_2_category_content_2_title', '宝石リフォーム'),
(21957, 4717, '_categories_2_category_content_2_title', 'field_5808324599b35'),
(21958, 4717, 'categories_2_category_content_2_discription', 'ヨシダでは、お客様に「頼んでよかった！」といっていただけるようにご希望のデザインや価格に充分にご納得いただいた上で加工を行っております。「ちょっとデザインを変えたい」というご要望にはプチプライスでお応え致しますので、お気軽にご相談下さい。\r\n\r\n１．ご来店・ご相談\r\n２．あなたにあったプランを選択\r\n３．職人による加工\r\n４．ご納品\r\n\r\nあなたの想いが詰まったジュエリーが完成！'),
(21959, 4717, '_categories_2_category_content_2_discription', 'field_5808329799b36'),
