(21971, 4717, '_appearance_1_title', 'field_58181ebe7c19a'),
(21972, 4717, 'appearance_1_comment', '明治16年\r\n\r\n佐賀の士族だった初代吉田清一郎、横浜にてアメリカ人のエンソン氏に師事し、時計技術を学ぶ。\r\n\r\n明治18年\r\n\r\n故郷佐賀にて時計店を開業。\r\n\r\n～\r\n\r\n平成25年\r\n\r\n第3回北九州市オンリーワン企業大賞を小売業界で初受賞。\r\n\r\n平成26年\r\n\r\n第20回福岡ひびき経営者賞受賞（販売サービス部門）\r\n\r\n\r\n平成27年　１年間を通じて創業130年祭実施中！\r\n\r\nぜひの御来店をお願い致します。'),
