(22168, 4718, 'categories_1_category_content_1_title', '鹿児島市　Ｍ様'),
(22169, 4718, '_categories_1_category_content_1_title', 'field_5808324599b35'),
(22170, 4718, 'categories_1_category_content_1_discription', '事前に入念に調査して現場を写真で説明頂いたので、安心してお任せする事が出来ました。\r\nまた使用する薬剤も料金表と一緒に一覧表で説明があったので納得出来ました。\r\n人柄も言葉等も良かったです。ありがとうございました。'),
