(22248, 4735, 'categories_0_category_content_0_title', '●駆除は分かるけど、なぜ予防はしないといけないの？'),
(22249, 4735, '_categories_0_category_content_0_title', 'field_5808324599b35'),
(22250, 4735, 'categories_0_category_content_0_discription', '理由その①\r\n\r\nシロアリ被害に気付いた時には、何十万・何百万の修繕費用が必要に…被害を防ぐ為にも未然の予防を！\r\n\r\n理由その②\r\n\r\n老朽化の原因の劣化は、材の腐朽とシロアリによる食害の２つがあります。木部保存効果のあるシロアリ予防もおすすめ！\r\n\r\n理由その③\r\n\r\nいつまでも笑顔で暮らせるお住まいを守りたいという思いから、シロアリ予防にも力をいれております。\r\n\r\n※もし工事内容にご満足、ご納得頂けない場合は工事代金の請求は致しません！ '),
