(22255, 4735, '_categories_0_category_content_1_title', 'field_5808324599b35'),
(22256, 4735, 'categories_0_category_content_1_discription', '☆シロアリ駆除の場合☆\r\n\r\n①安さ１番プラン　\r\n7..5万円～　　　３年保証付\r\n\r\n②一般プラン　\r\n１１万円～　　　５年保証付\r\n\r\n③低臭＆木部防腐プラン　\r\n１５万円～　　　\r\n５年保証付＋認定書付\r\n\r\n\r\n☆シロアリ予防の場合☆\r\n\r\n①安さ一番プラン　\r\n６．４万円ポッキリ　　　３年保証付\r\n\r\n②一般プラン　\r\n９．３万円ポッキリ　　　５年保証付\r\n\r\n③低臭＆木部防腐プラン\r\n13.1万円ポッキリ　　　\r\n5年保障付＋認定書付\r\n\r\n※強引な訪問営業は\r\nいっさい行いません！'),
