(22294, 4718, 'appearance_0_title', 'メッセージ・ サービス・ イベント'),
(22295, 4718, '_appearance_0_title', 'field_58181ebe7c19a'),
(22296, 4718, 'appearance_0_comment', '創業してから３０年余り、私達『富永シロアリ』はお客様方のお力添えを頂きながらコツコツと技術と知識を磨き、確かな実績を積み上げてまいりました。\r\n\r\n☆シロアリ防除士の資格を持つ三人が全力で作業にあたらせていただいております。\r\nチームワークには自信があり、『自分達の手で安心できるシロアリ防除を行い、そしてシロアリの不安からご家族を、お住まいを笑顔にする！』\r\n\r\nこれが私達の願いであります！！'),
(22297, 4718, '_appearance_0_comment', 'field_58181eff7c19b'),
(22298, 4718, 'appearance_0_image', '4736'),
(22299, 4718, '_appearance_0_image', 'field_58181f217c19c'),
(22300, 4718, 'appearance_1_title', 'メッセージ・ サービス・ イベント'),
(22301, 4718, '_appearance_1_title', 'field_58181ebe7c19a'),
(22302, 4718, 'appearance_1_comment', '☆竹材リフォームってご存知ですか？？\r\n\r\n１９５３年に竹材店として鹿児島市に誕生しました。現在、人工の竹垣を多くの業者さん等が取り扱うようになり、残念な事に、本物の竹垣の知識もなく、ずさんな施工を行っている業者もいます。\r\n\r\nそんな中、昔から愛される『本物の竹の良さ』を伝えたい！竹が持つしなやかさや美しさ、竹が持つ人々の心を和ませる力、これを少しでも多くの方に知って頂きたく、私達は活動致しております。'),
