(22422, 4738, 'appearance_1_title', 'メッセージ・ サービス・ イベント'),
(22423, 4738, '_appearance_1_title', 'field_58181ebe7c19a'),
(22424, 4738, 'appearance_1_comment', '☆竹材リフォームってご存知ですか？？\r\n\r\n１９５３年に竹材店として鹿児島市に誕生しました。現在、人工の竹垣を多くの業者さん等が取り扱うようになり、残念な事に、本物の竹垣の知識もなく、ずさんな施工を行っている業者もいます。\r\n\r\nそんな中、昔から愛される『本物の竹の良さ』を伝えたい！竹が持つしなやかさや美しさ、竹が持つ人々の心を和ませる力、これを少しでも多くの方に知って頂きたく、私達は活動致しております。'),
