(22487, 4739, '_categories_0_category_content_0_image', 'field_5808322599b34'),
(22488, 4739, 'categories_0_category_content_0_title', '●駆除は分かるけど、なぜ予防はしないといけないの？'),
(22489, 4739, '_categories_0_category_content_0_title', 'field_5808324599b35'),
(22490, 4739, 'categories_0_category_content_0_discription', '理由その①\r\n\r\nシロアリ被害に気付いた時には、何十万・何百万の修繕費用が必要に…被害を防ぐ為にも未然の予防を！\r\n\r\n理由その②\r\n\r\n老朽化の原因の劣化は、材の腐朽とシロアリによる食害の２つがあります。木部保存効果のあるシロアリ予防もおすすめ！\r\n\r\n理由その③\r\n\r\nいつまでも笑顔で暮らせるお住まいを守りたいという思いから、シロアリ予防にも力をいれております。\r\n\r\n※もし工事内容にご満足、ご納得頂けない場合は工事代金の請求は致しません！ '),
(22491, 4739, '_categories_0_category_content_0_discription', 'field_5808329799b36'),
(22492, 4739, 'categories_0_category_content_1_image', '4730'),
(22493, 4739, '_categories_0_category_content_1_image', 'field_5808322599b34'),
(22494, 4739, 'categories_0_category_content_1_title', '●駆除・予防の参考価格　　↓床下１５坪＝４９．５㎡のご住宅様'),
(22495, 4739, '_categories_0_category_content_1_title', 'field_5808324599b35'),
(22496, 4739, 'categories_0_category_content_1_discription', '☆シロアリ駆除の場合☆\r\n\r\n①安さ１番プラン　\r\n7..5万円～　　　３年保証付\r\n\r\n②一般プラン　\r\n１１万円～　　　５年保証付\r\n\r\n③低臭＆木部防腐プラン　\r\n１５万円～　　　\r\n５年保証付＋認定書付\r\n\r\n\r\n☆シロアリ予防の場合☆\r\n\r\n①安さ一番プラン　\r\n６．４万円ポッキリ　　　３年保証付\r\n\r\n②一般プラン　\r\n９．３万円ポッキリ　　　５年保証付\r\n\r\n③低臭＆木部防腐プラン\r\n13.1万円ポッキリ　　　\r\n5年保障付＋認定書付\r\n\r\n※強引な訪問営業は\r\nいっさい行いません！'),
(22497, 4739, '_categories_0_category_content_1_discription', 'field_5808329799b36'),
(22498, 4739, 'categories_0_category_content_2_image', '4731'),
(22499, 4739, '_categories_0_category_content_2_image', 'field_5808322599b34'),
(22500, 4739, 'categories_0_category_content_2_title', '●お問い合わせは通話料無料の０８００-１７０-１０３７まで'),
(22501, 4739, '_categories_0_category_content_2_title', 'field_5808324599b35'),
(22502, 4739, 'categories_0_category_content_2_discription', '◆自分たちの手で安心できる\r\n　 シロアリ駆除を誠実に行う！\r\n　 そして白蟻の不安からご家族を\r\n笑顔にする！\r\n　 それが私達の思いです！\r\n\r\n\r\n\r\n\r\n※ご相談・初回出張点検・見積もり・全て無料です。\r\nお気軽にお問合せ下さい。\r\n\r\n●お問い合わせは通話料無料の\r\n０８００－１７０－１０３７まで '),
