(23093, 4767, 'appearance_0_comment', '◆トリミング◆\r\n完全予約制、送迎可能（有料）\r\n\r\n◆フード◆\r\nオーブンベイクド、キアオラ、ソルビダ、ジウイピーク\r\nアズミラ、トライプ缶、生肉etc・・・\r\n\r\n◆オヤツ・サプリ◆\r\n犬自然工房、さかい企画、帝塚山ハウンドカム商品\r\n\r\n◆ホテル◆\r\n小型犬一泊2500円～\r\n自宅兼用ホテル'),
