(23870, 4792, '_categories_0_category_content_0_title', 'field_5808324599b35'),
(23871, 4792, 'categories_0_category_content_0_discription', '八幡東区　祇園交差点を八幡中央高等学校方面に進み、祇園四丁目信号のそばにサロンはあります。\r\n\r\n駐車場もございますので、車でお越しの方はお声掛けください。 '),
