(23874, 4792, '_categories_0_category_content_1_image', 'field_5808322599b34'),
(23875, 4792, 'categories_0_category_content_1_title', '大切なワンちゃんを丁寧にお手入れします'),
(23876, 4792, '_categories_0_category_content_1_title', 'field_5808324599b35'),
(23877, 4792, 'categories_0_category_content_1_discription', 'ワンちゃんには、いつもキレイで健康でいてもらいたいですね～\r\n\r\nでも、リーズナブルでず～っとワンちゃんとお付き合いしていきたいです。\r\n\r\nネコちゃんもOKですよ。\r\n　　　　　　　　　　　　by　オーナー'),
(23878, 4792, '_categories_0_category_content_1_discription', 'field_5808329799b36'),
