(23898, 4792, '_categories_1_category_content_1_image', 'field_5808322599b34'),
(23899, 4792, 'categories_1_category_content_1_title', '定位置（≧∇≦）'),
(23900, 4792, '_categories_1_category_content_1_title', 'field_5808324599b35'),
(23901, 4792, 'categories_1_category_content_1_discription', '　平日、ほぼ毎日、お預かりで来るコーギーの脇園ももチャン\r\n帰る30分前になったら自らこの位置で飼い主さんのお迎えを待ちます^_−☆可愛いッッ（≧∇≦） '),
(23902, 4792, '_categories_1_category_content_1_discription', 'field_5808329799b36'),
(23903, 4792, 'categories_1_category_content_2_image', '4640'),
(23904, 4792, '_categories_1_category_content_2_image', 'field_5808322599b34'),
(23905, 4792, 'categories_1_category_content_2_title', '　私が1番(((o(*ﾟ▽ﾟ*)o)))'),
(23906, 4792, '_categories_1_category_content_2_title', 'field_5808324599b35'),
(23907, 4792, 'categories_1_category_content_2_discription', 'トリミングはもちろん、預かりにも来てくれるシーズーの清水るるチャン（＾ν＾）仕草がとても可愛いく、他のワンコを触るとヤキモチを妬いてくれます（≧∇≦）\r\n外を通る人にも超アピールします❗️近くの高校生が\r\n可愛いって言ってくれるのが嬉しいみたいですよ(^ー゜)'),
(23908, 4792, '_categories_1_category_content_2_discription', 'field_5808329799b36'),
(23909, 4792, 'categories_1_category_content_3_image', '4641'),
(23910, 4792, '_categories_1_category_content_3_image', 'field_5808322599b34'),
