(24167, 4798, '_categories_1_category_content_0_title', 'field_5808324599b35'),
(24168, 4798, 'categories_1_category_content_0_discription', 'トイプードルのルイチャンです✨全身ハサミでカットしています\r\n身体より足を短めにしてます！子羊チャンみたいなルイチャン\r\nお母さんが大好きで仕方ありません '),
