(24173, 4798, '_categories_1_category_content_1_title', 'field_5808324599b35'),
(24174, 4798, 'categories_1_category_content_1_discription', '　平日、ほぼ毎日、お預かりで来るコーギーの脇園ももチャン\r\n帰る30分前になったら自らこの位置で飼い主さんのお迎えを待ちます^_−☆可愛いッッ（≧∇≦） '),
