(24185, 4798, '_categories_1_category_content_3_title', 'field_5808324599b35'),
(24186, 4798, 'categories_1_category_content_3_discription', '●シャンプーコース【一例】\r\n・フレンチブル、パグ…\\2,800\r\n・ビーグル…\\3,800\r\n・柴犬…\\3,900\r\n・コーギー…\\4,000\r\n・シェルティー…\\5,000\r\n・ラブラドール…\\5,500\r\n\r\n●シャンプー&カットコース【一例】\r\n・チワワ…\\2,900\r\n・Mダックス…\\3,000\r\n・シーズー…\\3,900\r\n・マルチーズ、ポメラニアン…\\3,800\r\n・Tプードル、シュナウザー…\\4,200\r\n・ゴールデン…\\7,000'),
