(24203, 4798, '_appearance_0_title', 'field_58181ebe7c19a'),
(24204, 4798, 'appearance_0_comment', '【４月７日グランドオープン！！】\r\n\r\nワンちゃん達に　いつもキレイに健康でいてもらいたいと願い、\r\nリーズナブルで通いやすい設定のサロンにしたいとの思いで\r\n「SINAMON}をオープンしました。\r\n\r\n一人でやってますので『予約優先』の営業です。\r\n末長くよろしくお願いします！'),
