(24264, 4780, '_categories_0_category_content_0_image', 'field_5808322599b34'),
(24265, 4780, 'categories_0_category_content_0_title', '十間風呂'),
(24266, 4780, '_categories_0_category_content_0_title', 'field_5808324599b35'),
(24267, 4780, 'categories_0_category_content_0_discription', '王丸の地下約1400mから汲み上げる湯量は、毎分約230ℓ。いつでも新鮮なお湯に浸かっていただけます。内湯の一番の見所は、幅が十間（約18m）もある大浴場のお風呂です。女性の十間風呂の窓は、紫外線カット率99％のシールを施しておりますので、紫外線を気にせずお楽しみいただけます。（露天の一部、家族風呂は王丸天然水を使用） '),
(24268, 4780, '_categories_0_category_content_0_discription', 'field_5808329799b36'),
(24269, 4780, 'categories_0_category_content_1_image', '4796'),
(24270, 4780, '_categories_0_category_content_1_image', 'field_5808322599b34'),
(24271, 4780, 'categories_0_category_content_1_title', '"月"モチーフの湯'),
(24272, 4780, '_categories_0_category_content_1_title', 'field_5808324599b35'),
(24273, 4780, 'categories_0_category_content_1_discription', '露天風呂には、月をモチーフにした様々な浴槽がございます。男湯と女湯の境にある満月湯は、見上げるとまるで満月を眺めているような感覚を味わえます。また大人一人がちょうど入れる大きさで、王丸の「丸」にちなんだ丸いデザインを施し、かわいらしい浴槽の「壺湯」もあります。 '),
(24274, 4780, '_categories_0_category_content_1_discription', 'field_5808329799b36'),
(24275, 4780, 'categories_0_category_content_2_image', '4797'),
(24276, 4780, '_categories_0_category_content_2_image', 'field_5808322599b34'),
(24277, 4780, 'categories_0_category_content_2_title', '温泉ミストサウナ'),
(24278, 4780, '_categories_0_category_content_2_title', 'field_5808324599b35'),
(24279, 4780, 'categories_0_category_content_2_discription', 'つるつるすべすべの美肌の湯を加熱して、超微粒子のミストを室内に噴射。微細な粒子が、髪や肌にしみこみ、細胞活性化とリラックス効果が期待できます \r\n'),
