(24399, 4817, 'categories_0_category_content_0_title', '十間風呂'),
(24400, 4817, '_categories_0_category_content_0_title', 'field_5808324599b35'),
(24401, 4817, 'categories_0_category_content_0_discription', '王丸の地下約1400mから汲み上げる湯量は、毎分約230ℓ。いつでも新鮮なお湯に浸かっていただけます。内湯の一番の見所は、幅が十間（約18m）もある大浴場のお風呂です。女性の十間風呂の窓は、紫外線カット率99％のシールを施しておりますので、紫外線を気にせずお楽しみいただけます。（露天の一部、家族風呂は王丸天然水を使用） '),
(24402, 4817, '_categories_0_category_content_0_discription', 'field_5808329799b36'),
(24403, 4817, 'categories_0_category_content_1_image', '4796'),
(24404, 4817, '_categories_0_category_content_1_image', 'field_5808322599b34'),
(24405, 4817, 'categories_0_category_content_1_title', '"月"モチーフの湯'),
(24406, 4817, '_categories_0_category_content_1_title', 'field_5808324599b35'),
(24407, 4817, 'categories_0_category_content_1_discription', '露天風呂には、月をモチーフにした様々な浴槽がございます。男湯と女湯の境にある満月湯は、見上げるとまるで満月を眺めているような感覚を味わえます。また大人一人がちょうど入れる大きさで、王丸の「丸」にちなんだ丸いデザインを施し、かわいらしい浴槽の「壺湯」もあります。 '),
(24408, 4817, '_categories_0_category_content_1_discription', 'field_5808329799b36'),
(24409, 4817, 'categories_0_category_content_2_image', '4797'),
(24410, 4817, '_categories_0_category_content_2_image', 'field_5808322599b34'),
(24411, 4817, 'categories_0_category_content_2_title', '温泉ミストサウナ'),
(24412, 4817, '_categories_0_category_content_2_title', 'field_5808324599b35'),
(24413, 4817, 'categories_0_category_content_2_discription', 'つるつるすべすべの美肌の湯を加熱して、超微粒子のミストを室内に噴射。微細な粒子が、髪や肌にしみこみ、細胞活性化とリラックス効果が期待できます \r\n'),
(24414, 4817, '_categories_0_category_content_2_discription', 'field_5808329799b36'),
(24415, 4817, 'categories_0_category_content', '3'),
(24416, 4817, '_categories_0_category_content', 'field_5807d5dffe066'),
(24417, 4817, 'categories_1_category_name', '●旬彩割烹 白珪'),
(24418, 4817, '_categories_1_category_name', 'field_5807d57dfe064'),
(24419, 4817, 'categories_1_hide_flg', ''),
(24420, 4817, '_categories_1_hide_flg', 'field_5807d59cfe065'),
(24421, 4817, 'categories_1_category_content_0_image', '4799'),
(24422, 4817, '_categories_1_category_content_0_image', 'field_5808322599b34'),
(24423, 4817, 'categories_1_category_content_0_title', 'こだわりの逸品料理'),
(24424, 4817, '_categories_1_category_content_0_title', 'field_5808324599b35'),
(24425, 4817, 'categories_1_category_content_0_discription', '新鮮な海の幸や、牛肉本来の味を楽しめるむなかた牛を使った逸品料理。白珪のこだわりの料理をご堪能下さい！また白珪では、各種宴会も承っております。宗像の自然を望む開放的な宴会場で、楽しいひとときをお過ごしください。'),
(24426, 4817, '_categories_1_category_content_0_discription', 'field_5808329799b36'),
(24427, 4817, 'categories_1_category_content_1_image', '4810'),
(24428, 4817, '_categories_1_category_content_1_image', 'field_5808322599b34'),
(24429, 4817, 'categories_1_category_content_1_title', '無料送迎いたします☆'),
(24430, 4817, '_categories_1_category_content_1_title', 'field_5808324599b35'),
(24431, 4817, 'categories_1_category_content_1_discription', '旬彩割烹白珪を10名様以上でご予約のお客様は、片道60分圏内の場所まで、送迎いたします！\r\n条件等ございますので、詳しくはお問合せ下さい。 \r\n'),
(24432, 4817, '_categories_1_category_content_1_discription', 'field_5808329799b36'),
(24433, 4817, 'categories_1_category_content_2_image', '4812'),
(24434, 4817, '_categories_1_category_content_2_image', 'field_5808322599b34'),
(24435, 4817, 'categories_1_category_content_2_title', 'お食事と一緒に温泉もいかがですか♪'),
(24436, 4817, '_categories_1_category_content_2_title', 'field_5808324599b35'),
(24437, 4817, 'categories_1_category_content_2_discription', '旬彩割烹白珪をご予約のお客様は、200円でご入浴が可能です！\r\n200円にフェイスタオル1枚、入湯税50円が含まれます。\r\n（※4歳未満または身長100cm未満のお子様は家族風呂のみのご利用となります） '),
(24438, 4817, '_categories_1_category_content_2_discription', 'field_5808329799b36'),
