(24550, 4818, '_categories_1_category_content_0_title', 'field_5808324599b35'),
(24551, 4818, 'categories_1_category_content_0_discription', '新鮮な海の幸や、牛肉本来の味を楽しめるむなかた牛を使った逸品料理。白珪のこだわりの料理をご堪能下さい！また白珪では、各種宴会も承っております。宗像の自然を望む開放的な宴会場で、楽しいひとときをお過ごしください。'),
