(24556, 4818, '_categories_1_category_content_1_title', 'field_5808324599b35'),
(24557, 4818, 'categories_1_category_content_1_discription', '旬彩割烹白珪を10名様以上でご予約のお客様は、片道60分圏内の場所まで、送迎いたします！\r\n条件等ございますので、詳しくはお問合せ下さい。 \r\n'),
