(24721, 4820, 'categories_1_category_content_1_discription', '　平日、ほぼ毎日、お預かりで来るコーギーの脇園ももチャン\r\n帰る30分前になったら自らこの位置で飼い主さんのお迎えを待ちます^_−☆可愛いッッ（≧∇≦） '),
(24722, 4820, '_categories_1_category_content_1_discription', 'field_5808329799b36'),
(24723, 4820, 'categories_1_category_content_2_image', '4640'),
(24724, 4820, '_categories_1_category_content_2_image', 'field_5808322599b34'),
(24725, 4820, 'categories_1_category_content_2_title', '　私が1番(((o(*ﾟ▽ﾟ*)o)))'),
(24726, 4820, '_categories_1_category_content_2_title', 'field_5808324599b35'),
(24727, 4820, 'categories_1_category_content_2_discription', 'トリミングはもちろん、預かりにも来てくれるシーズーの清水るるチャン（＾ν＾）仕草がとても可愛いく、他のワンコを触るとヤキモチを妬いてくれます（≧∇≦）\r\n外を通る人にも超アピールします❗️近くの高校生が\r\n可愛いって言ってくれるのが嬉しいみたいですよ(^ー゜)'),
(24728, 4820, '_categories_1_category_content_2_discription', 'field_5808329799b36'),
(24729, 4820, 'categories_1_category_content_3_image', '4641'),
(24730, 4820, '_categories_1_category_content_3_image', 'field_5808322599b34'),
(24731, 4820, 'categories_1_category_content_3_title', 'メニュー【美容★シャンプーコース／シャンプー&カットコース】'),
(24732, 4820, '_categories_1_category_content_3_title', 'field_5808324599b35'),
(24733, 4820, 'categories_1_category_content_3_discription', '●シャンプーコース【一例】\r\n・フレンチブル、パグ…\\2,800\r\n・ビーグル…\\3,800\r\n・柴犬…\\3,900\r\n・コーギー…\\4,000\r\n・シェルティー…\\5,000\r\n・ラブラドール…\\5,500\r\n\r\n●シャンプー&カットコース【一例】\r\n・チワワ…\\2,900\r\n・Mダックス…\\3,000\r\n・シーズー…\\3,900\r\n・マルチーズ、ポメラニアン…\\3,800\r\n・Tプードル、シュナウザー…\\4,200\r\n・ゴールデン…\\7,000'),
(24734, 4820, '_categories_1_category_content_3_discription', 'field_5808329799b36'),
