(24738, 4820, '_categories_1_category_content_4_title', 'field_5808324599b35'),
(24739, 4820, 'categories_1_category_content_4_discription', '・小型犬…\\2,500\r\n・中型犬…\\3,500\r\n・大型犬…\\4,500\r\n★散歩付き、冷・暖房完備\r\n※GW・お盆は300円増\r\n年末年始のホテルはしていません\r\n◎ペットホテルご利用時 美容をされる方。\r\n　1泊2日…美容代５％OFF\r\n　2泊3日…美容代１０％OFF\r\n'),
