(24847, 4821, 'categories_0_category_content_1_title', '大切なワンちゃんを丁寧にお手入れします'),
(24848, 4821, '_categories_0_category_content_1_title', 'field_5808324599b35'),
(24849, 4821, 'categories_0_category_content_1_discription', 'ワンちゃんには、いつもキレイで健康でいてもらいたいですね～\r\n\r\nでも、リーズナブルでず～っとワンちゃんとお付き合いしていきたいです。\r\n\r\nネコちゃんもOKですよ。\r\n　　　　　　　　　　　　by　オーナー'),
