(24878, 4821, '_categories_1_category_content_2_title', 'field_5808324599b35'),
(24879, 4821, 'categories_1_category_content_2_discription', 'トリミングはもちろん、預かりにも来てくれるシーズーの清水るるチャン（＾ν＾）仕草がとても可愛いく、他のワンコを触るとヤキモチを妬いてくれます（≧∇≦）\r\n外を通る人にも超アピールします❗️近くの高校生が\r\n可愛いって言ってくれるのが嬉しいみたいですよ(^ー゜)'),
(24880, 4821, '_categories_1_category_content_2_discription', 'field_5808329799b36'),
