(25007, 4822, 'categories_0_category_content_0_discription', 'ダイエットや健康に効果的だけど、買うと１本７０００円以上する高価な「酵素ジュース」を簡単に手作りしてみませんか？\r\n\r\n参加費は、材料代全て込みで4000円です '),
(25008, 4822, '_categories_0_category_content_0_discription', 'field_5808329799b36'),
(25009, 4822, 'categories_0_category_content_1_image', '4631'),
(25010, 4822, '_categories_0_category_content_1_image', 'field_5808322599b34'),
(25011, 4822, 'categories_0_category_content_1_title', '酵素とは'),
(25012, 4822, '_categories_0_category_content_1_title', 'field_5808324599b35'),
(25013, 4822, 'categories_0_category_content_1_discription', '酵素は「命のろうそく」と言われるほど、体にとって大切なもので、 生命活動の全てに関わっています。\r\n\r\n一生のうち体で作られる体内酵素の量は決まっています。\r\n\r\n２０代をピークに次第に作られる量が減り始め、４０代からは急激に減りだします。\r\n\r\n体内酵素（潜在酵素）は食物を消化・吸収する消化酵素と体の新陳代謝を司る代謝酵素に分かれます。'),
