(25023, 4822, 'categories_1_category_content_0_title', 'アドバイサー資格'),
(25024, 4822, '_categories_1_category_content_0_title', 'field_5808324599b35'),
(25025, 4822, 'categories_1_category_content_0_discription', '人間にとって非常に大切な『酵素』の優位性に着目し、酵素を取り入れた『酵素生活』\r\nを一緒に普及しましょう♪ 『酵素ジュース作り』と『酵素生活』『酵素ダイエット（ファスティング）』の\r\n正しい知識と実践法を習得し、 第三者に対してカウンセリングができるます！\r\n\r\n『楽しく学べて細胞から元気になり、 美しく、そして健康になれる』そんな素晴らしいアドバイザー資格です。 '),
(25026, 4822, '_categories_1_category_content_0_discription', 'field_5808329799b36'),
(25027, 4822, 'categories_1_category_content_1_image', '4635'),
(25028, 4822, '_categories_1_category_content_1_image', 'field_5808322599b34'),
(25029, 4822, 'categories_1_category_content_1_title', 'アドバイザー資格'),
(25030, 4822, '_categories_1_category_content_1_title', 'field_5808324599b35'),
(25031, 4822, 'categories_1_category_content_1_discription', '酵素ジュース作りの教え方、酵素栄養学、酵素を使った正しいダイエット（ファスティング）法を楽しく学び\r\n\r\n健康教室を開けるアドバイザー資格です♪\r\n\r\n◎酵素ジュースアドバイザー\r\n1日（3時間）　21,600円\r\n+　実技の材料費4,000円　　\r\n合計25,600円（税込み）\r\n※認定書込みの金額です。\r\n\r\n\r\n【受講時間】 ライフスタイルに合わせて、ご希望のお時間での受講が可能です。 \r\n○1dayコース（3h） 　'),
(25032, 4822, '_categories_1_category_content_1_discription', 'field_5808329799b36'),
(25033, 4822, 'categories_1_category_content_2_image', '4638'),
