(25036, 4822, '_categories_1_category_content_2_title', 'field_5808324599b35'),
(25037, 4822, 'categories_1_category_content_2_discription', '酵素生活を広めてみませんか？\r\n\r\n企業様やサロン様にお邪魔して、出張酵素ジュース教室もできます\r\n\r\n楽しく酵素生活を広げましょう♪\r\n\r\n\r\nまた、酵素ファスティングなどの知識もお伝えしますので\r\nダイエットや健康に興味がある人も大満足な内容になっています！\r\n'),
