(25555, 4824, 'categories_0_category_content_0_title', 'オークリー'),
(25556, 4824, '_categories_0_category_content_0_title', 'field_5808324599b35'),
(25557, 4824, 'categories_0_category_content_0_discription', 'スポーツサングラス『OAKLEY』の度付きに特化しています。\r\nオークリーの度付きをご検討の方、ぜひ一度ご相談ください☆\r\nブログ：オークリーの度付きができるお店\r\nＦＢページ：オークリーの度付きができるお店 ヨシダ\r\n随時更新中!! '),
(25558, 4824, '_categories_0_category_content_0_discription', 'field_5808329799b36'),
(25559, 4824, 'categories_0_category_content_1_image', '4692'),
(25560, 4824, '_categories_0_category_content_1_image', 'field_5808322599b34'),
(25561, 4824, 'categories_0_category_content_1_title', '999,9 フォーナインズ'),
(25562, 4824, '_categories_0_category_content_1_title', 'field_5808324599b35'),
(25563, 4824, 'categories_0_category_content_1_discription', '日本を代表するメガネブランド『フォーナインズ』を豊富に取り揃えています。\r\nサングラスライン『999,9feelsun』も取り扱っています。 '),
