(25578, 4824, '_categories_1_category_content_0_image', 'field_5808322599b34'),
(25579, 4824, 'categories_1_category_content_0_title', 'アイスウォッチ'),
(25580, 4824, '_categories_1_category_content_0_title', 'field_5808324599b35'),
(25581, 4824, 'categories_1_category_content_0_discription', '2007年、ベルギー発のファッションウォッチ「アイスウォッチ」。\r\n\r\n世界100カ国以上の国と地域で販売されています。\r\n海外セレブから国内の芸能人にも多数愛用されています。\r\n\r\n多彩な色とユニークな素材を使い、高品質ながらお求め\r\nやすい価格なのも魅力の一つです。 '),
(25582, 4824, '_categories_1_category_content_0_discription', 'field_5808329799b36'),
(25583, 4824, 'categories_1_category_content_1_image', '4695'),
(25584, 4824, '_categories_1_category_content_1_image', 'field_5808322599b34'),
(25585, 4824, 'categories_1_category_content_1_title', 'セイコールキア'),
(25586, 4824, '_categories_1_category_content_1_title', 'field_5808324599b35'),
(25587, 4824, 'categories_1_category_content_1_discription', 'セイコー ルキアは、前向きに自分らしく生きていく女性たちを輝かせるウオッチ。高機能とスマートなデザインをあわせ持ち、たくさんの女性たちに支持されています。\r\n\r\n他にもブライツ、グランドセイコーなどセイコーのほとんどの商品を取り扱っています。'),
(25588, 4824, '_categories_1_category_content_1_discription', 'field_5808329799b36'),
(25589, 4824, 'categories_1_category_content_2_image', '4696'),
(25590, 4824, '_categories_1_category_content_2_image', 'field_5808322599b34'),
(25591, 4824, 'categories_1_category_content_2_title', 'シチズン　クロスシー'),
(25592, 4824, '_categories_1_category_content_2_title', 'field_5808324599b35'),
(25593, 4824, 'categories_1_category_content_2_discription', '軽く、肌にやさしく、美しい。\r\nクロスシーが磨き上げた、洗練のチタニウムモデル。\r\n圧倒的な軽さと小ぶりサイズな上に、定期的な電池交換も時刻合わせもいらない、エコ・ドライブ電波時計を搭載。\r\n他にも、カンパノラ、アテッサ、エクシード、ウィッカなどほとんどの商品を取り扱っています。 '),
(25594, 4824, '_categories_1_category_content_2_discription', 'field_5808329799b36'),
(25595, 4824, 'categories_1_category_content', '3'),
(25596, 4824, '_categories_1_category_content', 'field_5807d5dffe066'),
(25597, 4824, 'categories_2_category_name', '●宝石／マリッジリング／宝石リフォーム'),
(25598, 4824, '_categories_2_category_name', 'field_5807d57dfe064'),
(25599, 4824, 'categories_2_hide_flg', ''),
(25600, 4824, '_categories_2_hide_flg', 'field_5807d59cfe065'),
(25601, 4824, 'categories_2_category_content_0_image', '4698'),
(25602, 4824, '_categories_2_category_content_0_image', 'field_5808322599b34'),
(25603, 4824, 'categories_2_category_content_0_title', 'マリッジリング『遥』'),
(25604, 4824, '_categories_2_category_content_0_title', 'field_5808324599b35'),
(25605, 4824, 'categories_2_category_content_0_discription', 'ピンクゴールドとホワイトゴールドを使った遥ならではのデザイン。\r\n\r\n画像のリングは、幅が4mmのデザインです。\r\n\r\n少し太めの6ミリ幅のリングもございます。\r\n\r\n細身なので、着けやすいです。\r\nホワイトゴールドとピンクゴールドの組み合わせが優しい印象を与えます。'),
(25606, 4824, '_categories_2_category_content_0_discription', 'field_5808329799b36'),
(25607, 4824, 'categories_2_category_content_1_image', '4700'),
(25608, 4824, '_categories_2_category_content_1_image', 'field_5808322599b34'),
(25609, 4824, 'categories_2_category_content_1_title', '最高級真珠　花珠真珠と黒蝶真珠'),
(25610, 4824, '_categories_2_category_content_1_title', 'field_5808324599b35'),
(25611, 4824, 'categories_2_category_content_1_discription', '成人、ご就職、ご結婚、厄除けのお祝いに花珠真珠、\r\n法事などのお悔やみの席に黒蝶真珠をおすすめいたします。\r\n\r\nどちらもフォーマルのシーンにはかかせないもの。\r\n\r\n昔から変わることないデザインは、どの世代の方にも、どんなタイプの\r\n方が着けても襟元をきれいに飾ってくれます。\r\n\r\n人生の節目の時にお母様からお嬢様へのプレゼントにいかがでしょうか。\r\n'),
(25612, 4824, '_categories_2_category_content_1_discription', 'field_5808329799b36'),
(25613, 4824, 'categories_2_category_content_2_image', '4828'),
(25614, 4824, '_categories_2_category_content_2_image', 'field_5808322599b34'),
(25615, 4824, 'categories_2_category_content_2_title', '宝石リフォーム'),
(25616, 4824, '_categories_2_category_content_2_title', 'field_5808324599b35'),
(25617, 4824, 'categories_2_category_content_2_discription', 'ヨシダでは、お客様に「頼んでよかった！」といっていただけるようにご希望のデザインや価格に充分にご納得いただいた上で加工を行っております。「ちょっとデザインを変えたい」というご要望にはプチプライスでお応え致しますので、お気軽にご相談下さい。\r\n\r\n１．ご来店・ご相談\r\n２．あなたにあったプランを選択\r\n３．職人による加工\r\n４．ご納品\r\n\r\nあなたの想いが詰まったジュエリーが完成！'),
(25618, 4824, '_categories_2_category_content_2_discription', 'field_5808329799b36'),
