(25713, 4829, 'categories_1_category_content_0_title', 'アイスウォッチ'),
(25714, 4829, '_categories_1_category_content_0_title', 'field_5808324599b35'),
(25715, 4829, 'categories_1_category_content_0_discription', '2007年、ベルギー発のファッションウォッチ「アイスウォッチ」。\r\n\r\n世界100カ国以上の国と地域で販売されています。\r\n海外セレブから国内の芸能人にも多数愛用されています。\r\n\r\n多彩な色とユニークな素材を使い、高品質ながらお求め\r\nやすい価格なのも魅力の一つです。 '),
(25716, 4829, '_categories_1_category_content_0_discription', 'field_5808329799b36'),
(25717, 4829, 'categories_1_category_content_1_image', '4695'),
(25718, 4829, '_categories_1_category_content_1_image', 'field_5808322599b34'),
(25719, 4829, 'categories_1_category_content_1_title', 'セイコールキア'),
(25720, 4829, '_categories_1_category_content_1_title', 'field_5808324599b35'),
(25721, 4829, 'categories_1_category_content_1_discription', 'セイコー ルキアは、前向きに自分らしく生きていく女性たちを輝かせるウオッチ。高機能とスマートなデザインをあわせ持ち、たくさんの女性たちに支持されています。\r\n\r\n他にもブライツ、グランドセイコーなどセイコーのほとんどの商品を取り扱っています。'),
(25722, 4829, '_categories_1_category_content_1_discription', 'field_5808329799b36'),
(25723, 4829, 'categories_1_category_content_2_image', '4696'),
(25724, 4829, '_categories_1_category_content_2_image', 'field_5808322599b34'),
(25725, 4829, 'categories_1_category_content_2_title', 'シチズン　クロスシー'),
(25726, 4829, '_categories_1_category_content_2_title', 'field_5808324599b35'),
(25727, 4829, 'categories_1_category_content_2_discription', '軽く、肌にやさしく、美しい。\r\nクロスシーが磨き上げた、洗練のチタニウムモデル。\r\n圧倒的な軽さと小ぶりサイズな上に、定期的な電池交換も時刻合わせもいらない、エコ・ドライブ電波時計を搭載。\r\n他にも、カンパノラ、アテッサ、エクシード、ウィッカなどほとんどの商品を取り扱っています。 '),
(25728, 4829, '_categories_1_category_content_2_discription', 'field_5808329799b36'),
