(25735, 4829, 'categories_2_category_content_0_image', '4698'),
(25736, 4829, '_categories_2_category_content_0_image', 'field_5808322599b34'),
(25737, 4829, 'categories_2_category_content_0_title', 'マリッジリング『遥』'),
(25738, 4829, '_categories_2_category_content_0_title', 'field_5808324599b35'),
(25739, 4829, 'categories_2_category_content_0_discription', 'ピンクゴールドとホワイトゴールドを使った遥ならではのデザイン。\r\n\r\n画像のリングは、幅が4mmのデザインです。\r\n\r\n少し太めの6ミリ幅のリングもございます。\r\n\r\n細身なので、着けやすいです。\r\nホワイトゴールドとピンクゴールドの組み合わせが優しい印象を与えます。'),
(25740, 4829, '_categories_2_category_content_0_discription', 'field_5808329799b36'),
(25741, 4829, 'categories_2_category_content_1_image', '4700'),
(25742, 4829, '_categories_2_category_content_1_image', 'field_5808322599b34'),
(25743, 4829, 'categories_2_category_content_1_title', '最高級真珠　花珠真珠と黒蝶真珠'),
(25744, 4829, '_categories_2_category_content_1_title', 'field_5808324599b35'),
(25745, 4829, 'categories_2_category_content_1_discription', '成人、ご就職、ご結婚、厄除けのお祝いに花珠真珠、\r\n法事などのお悔やみの席に黒蝶真珠をおすすめいたします。\r\n\r\nどちらもフォーマルのシーンにはかかせないもの。\r\n\r\n昔から変わることないデザインは、どの世代の方にも、どんなタイプの\r\n方が着けても襟元をきれいに飾ってくれます。\r\n\r\n人生の節目の時にお母様からお嬢様へのプレゼントにいかがでしょうか。\r\n'),
(25746, 4829, '_categories_2_category_content_1_discription', 'field_5808329799b36'),
(25747, 4829, 'categories_2_category_content_2_image', '4828'),
(25748, 4829, '_categories_2_category_content_2_image', 'field_5808322599b34'),
(25749, 4829, 'categories_2_category_content_2_title', '宝石リフォーム'),
(25750, 4829, '_categories_2_category_content_2_title', 'field_5808324599b35'),
(25751, 4829, 'categories_2_category_content_2_discription', 'ヨシダでは、お客様に「頼んでよかった！」といっていただけるようにご希望のデザインや価格に充分にご納得いただいた上で加工を行っております。「ちょっとデザインを変えたい」というご要望にはプチプライスでお応え致しますので、お気軽にご相談下さい。\r\n\r\n１．ご来店・ご相談\r\n２．あなたにあったプランを選択\r\n３．職人による加工\r\n４．ご納品\r\n\r\nあなたの想いが詰まったジュエリーが完成！'),
(25752, 4829, '_categories_2_category_content_2_discription', 'field_5808329799b36'),
(25753, 4829, 'categories_2_category_content', '3'),
(25754, 4829, '_categories_2_category_content', 'field_5807d5dffe066'),
(25755, 4824, 'appearance_0_title', 'メッセージ・ サービス・ イベント'),
(25756, 4824, '_appearance_0_title', 'field_58181ebe7c19a'),
(25757, 4824, 'appearance_0_comment', '最新情報発信中➟ブログ・Ｆｅｃｅｂｏｏｋ\r\n社長・スタッフが日々更新中！！\r\n\r\n新商品の紹介・入荷予定日・お客様の紹介\r\nなど充実な内容♪'),
(25758, 4824, '_appearance_0_comment', 'field_58181eff7c19b'),
(25759, 4824, 'appearance_0_image', '4714'),
(25760, 4824, '_appearance_0_image', 'field_58181f217c19c'),
(25761, 4824, 'appearance_1_title', 'メッセージ・ サービス・ イベント'),
(25762, 4824, '_appearance_1_title', 'field_58181ebe7c19a'),
(25763, 4824, 'appearance_1_comment', '明治16年\r\n\r\n佐賀の士族だった初代吉田清一郎、横浜にてアメリカ人のエンソン氏に師事し、時計技術を学ぶ。\r\n\r\n明治18年\r\n\r\n故郷佐賀にて時計店を開業。\r\n\r\n～\r\n\r\n平成25年\r\n\r\n第3回北九州市オンリーワン企業大賞を小売業界で初受賞。\r\n\r\n平成26年\r\n\r\n第20回福岡ひびき経営者賞受賞（販売サービス部門）\r\n\r\n\r\n平成27年　１年間を通じて創業130年祭実施中！\r\n\r\nぜひの御来店をお願い致します。'),
