(26466, 4839, '_categories_1_category_content_0_title', 'field_5808324599b35'),
(26467, 4839, 'categories_1_category_content_0_discription', '2007年、ベルギー発のファッションウォッチ「アイスウォッチ」。\r\n\r\n世界100カ国以上の国と地域で販売されています。\r\n海外セレブから国内の芸能人にも多数愛用されています。\r\n\r\n多彩な色とユニークな素材を使い、高品質ながらお求め\r\nやすい価格なのも魅力の一つです。 '),
(26468, 4839, '_categories_1_category_content_0_discription', 'field_5808329799b36'),
(26469, 4839, 'categories_1_category_content_1_image', '4695'),
(26470, 4839, '_categories_1_category_content_1_image', 'field_5808322599b34'),
(26471, 4839, 'categories_1_category_content_1_title', 'セイコールキア'),
(26472, 4839, '_categories_1_category_content_1_title', 'field_5808324599b35'),
(26473, 4839, 'categories_1_category_content_1_discription', 'セイコー ルキアは、前向きに自分らしく生きていく女性たちを輝かせるウオッチ。高機能とスマートなデザインをあわせ持ち、たくさんの女性たちに支持されています。\r\n\r\n他にもブライツ、グランドセイコーなどセイコーのほとんどの商品を取り扱っています。'),
(26474, 4839, '_categories_1_category_content_1_discription', 'field_5808329799b36'),
(26475, 4839, 'categories_1_category_content_2_image', '4696'),
(26476, 4839, '_categories_1_category_content_2_image', 'field_5808322599b34'),
(26477, 4839, 'categories_1_category_content_2_title', 'シチズン　クロスシー'),
(26478, 4839, '_categories_1_category_content_2_title', 'field_5808324599b35'),
(26479, 4839, 'categories_1_category_content_2_discription', '軽く、肌にやさしく、美しい。\r\nクロスシーが磨き上げた、洗練のチタニウムモデル。\r\n圧倒的な軽さと小ぶりサイズな上に、定期的な電池交換も時刻合わせもいらない、エコ・ドライブ電波時計を搭載。\r\n他にも、カンパノラ、アテッサ、エクシード、ウィッカなどほとんどの商品を取り扱っています。 '),
(26480, 4839, '_categories_1_category_content_2_discription', 'field_5808329799b36'),
(26481, 4839, 'categories_1_category_content', '3'),
(26482, 4839, '_categories_1_category_content', 'field_5807d5dffe066'),
