(26488, 4839, '_categories_2_category_content_0_image', 'field_5808322599b34'),
(26489, 4839, 'categories_2_category_content_0_title', 'マリッジリング『遥』'),
(26490, 4839, '_categories_2_category_content_0_title', 'field_5808324599b35'),
(26491, 4839, 'categories_2_category_content_0_discription', 'ピンクゴールドとホワイトゴールドを使った遥ならではのデザイン。\r\n\r\n画像のリングは、幅が4mmのデザインです。\r\n\r\n少し太めの6ミリ幅のリングもございます。\r\n\r\n細身なので、着けやすいです。\r\nホワイトゴールドとピンクゴールドの組み合わせが優しい印象を与えます。'),
(26492, 4839, '_categories_2_category_content_0_discription', 'field_5808329799b36'),
(26493, 4839, 'categories_2_category_content_1_image', '4700'),
(26494, 4839, '_categories_2_category_content_1_image', 'field_5808322599b34'),
(26495, 4839, 'categories_2_category_content_1_title', '最高級真珠　花珠真珠と黒蝶真珠'),
(26496, 4839, '_categories_2_category_content_1_title', 'field_5808324599b35'),
(26497, 4839, 'categories_2_category_content_1_discription', '成人、ご就職、ご結婚、厄除けのお祝いに花珠真珠、\r\n法事などのお悔やみの席に黒蝶真珠をおすすめいたします。\r\n\r\nどちらもフォーマルのシーンにはかかせないもの。\r\n\r\n昔から変わることないデザインは、どの世代の方にも、どんなタイプの\r\n方が着けても襟元をきれいに飾ってくれます。\r\n\r\n人生の節目の時にお母様からお嬢様へのプレゼントにいかがでしょうか。\r\n'),
(26498, 4839, '_categories_2_category_content_1_discription', 'field_5808329799b36'),
(26499, 4839, 'categories_2_category_content_2_image', '4828'),
(26500, 4839, '_categories_2_category_content_2_image', 'field_5808322599b34'),
(26501, 4839, 'categories_2_category_content_2_title', '宝石リフォーム'),
(26502, 4839, '_categories_2_category_content_2_title', 'field_5808324599b35'),
(26503, 4839, 'categories_2_category_content_2_discription', 'ヨシダでは、お客様に「頼んでよかった！」といっていただけるようにご希望のデザインや価格に充分にご納得いただいた上で加工を行っております。「ちょっとデザインを変えたい」というご要望にはプチプライスでお応え致しますので、お気軽にご相談下さい。\r\n\r\n１．ご来店・ご相談\r\n２．あなたにあったプランを選択\r\n３．職人による加工\r\n４．ご納品\r\n\r\nあなたの想いが詰まったジュエリーが完成！'),
(26504, 4839, '_categories_2_category_content_2_discription', 'field_5808329799b36'),
(26505, 4839, 'categories_2_category_content', '3'),
