(26508, 4839, '_appearance_0_title', 'field_58181ebe7c19a'),
(26509, 4839, 'appearance_0_comment', '最新情報発信中➟ブログ・Ｆｅｃｅｂｏｏｋ\r\n社長・スタッフが日々更新中！！\r\n\r\n新商品の紹介・入荷予定日・お客様の紹介\r\nなど充実な内容♪'),
(26510, 4839, '_appearance_0_comment', 'field_58181eff7c19b'),
