(26675, 4840, 'categories_0_category_content_3_discription', '彩り豊かなフレンチデザインがメガネを楽しくしてくれます。\r\nラフォンの魅力をご紹介したブログ☆\r\nヨシダスタッフブログをぜひご覧ください♪'),
(26676, 4840, '_categories_0_category_content_3_discription', 'field_5808329799b36'),
(26954, 4842, 'categories_2_category_content_1_discription', '成人、ご就職、ご結婚、厄除けのお祝いに花珠真珠、\r\n法事などのお悔やみの席に黒蝶真珠をおすすめいたします。\r\n\r\nどちらもフォーマルのシーンにはかかせないもの。\r\n\r\n昔から変わることないデザインは、どの世代の方にも、どんなタイプの\r\n方が着けても襟元をきれいに飾ってくれます。\r\n\r\n人生の節目の時にお母様からお嬢様へのプレゼントにいかがでしょうか。\r\n'),
(26953, 4842, '_categories_2_category_content_1_title', 'field_5808324599b35'),
(26952, 4842, 'categories_2_category_content_1_title', '最高級真珠　花珠真珠と黒蝶真珠'),
