(26949, 4842, '_categories_2_category_content_0_discription', 'field_5808329799b36'),
(26948, 4842, 'categories_2_category_content_0_discription', 'ピンクゴールドとホワイトゴールドを使った遥ならではのデザイン。\r\n\r\n画像のリングは、幅が4mmのデザインです。\r\n\r\n少し太めの6ミリ幅のリングもございます。\r\n\r\n細身なので、着けやすいです。\r\nホワイトゴールドとピンクゴールドの組み合わせが優しい印象を与えます。'),
(26947, 4842, '_categories_2_category_content_0_title', 'field_5808324599b35'),
(26946, 4842, 'categories_2_category_content_0_title', 'マリッジリング『遥』'),
