(26937, 4842, '_categories_1_category_content_2_discription', 'field_5808329799b36'),
(26936, 4842, 'categories_1_category_content_2_discription', '軽く、肌にやさしく、美しい。\r\nクロスシーが磨き上げた、洗練のチタニウムモデル。\r\n圧倒的な軽さと小ぶりサイズな上に、定期的な電池交換も時刻合わせもいらない、エコ・ドライブ電波時計を搭載。\r\n他にも、カンパノラ、アテッサ、エクシード、ウィッカなどほとんどの商品を取り扱っています。 '),
(26935, 4842, '_categories_1_category_content_2_title', 'field_5808324599b35'),
(26931, 4842, '_categories_1_category_content_1_discription', 'field_5808329799b36'),
