(26933, 4842, '_categories_1_category_content_2_image', 'field_5808322599b34'),
(26934, 4842, 'categories_1_category_content_2_title', 'シチズン　クロスシー'),
(26929, 4842, '_categories_1_category_content_1_title', 'field_5808324599b35'),
(26930, 4842, 'categories_1_category_content_1_discription', 'セイコー ルキアは、前向きに自分らしく生きていく女性たちを輝かせるウオッチ。高機能とスマートなデザインをあわせ持ち、たくさんの女性たちに支持されています。\r\n\r\n他にもブライツ、グランドセイコーなどセイコーのほとんどの商品を取り扱っています。'),
(26928, 4842, 'categories_1_category_content_1_title', 'セイコールキア'),
(26927, 4842, '_categories_1_category_content_1_image', 'field_5808322599b34'),
