(27258, 4844, 'categories_2_category_content_1_title', '最高級真珠　花珠真珠と黒蝶真珠'),
(27257, 4844, '_categories_2_category_content_1_image', 'field_5808322599b34'),
(27256, 4844, 'categories_2_category_content_1_image', '4700'),
(27255, 4844, '_categories_2_category_content_0_discription', 'field_5808329799b36'),
(27254, 4844, 'categories_2_category_content_0_discription', 'ピンクゴールドとホワイトゴールドを使った遥ならではのデザイン。\r\n\r\n画像のリングは、幅が4mmのデザインです。\r\n\r\n少し太めの6ミリ幅のリングもございます。\r\n\r\n細身なので、着けやすいです。\r\nホワイトゴールドとピンクゴールドの組み合わせが優しい印象を与えます。'),
(27253, 4844, '_categories_2_category_content_0_title', 'field_5808324599b35'),
