(27243, 4844, '_categories_1_category_content_2_discription', 'field_5808329799b36'),
(27240, 4844, 'categories_1_category_content_2_title', 'シチズン　クロスシー'),
(27241, 4844, '_categories_1_category_content_2_title', 'field_5808324599b35'),
(27242, 4844, 'categories_1_category_content_2_discription', '軽く、肌にやさしく、美しい。\r\nクロスシーが磨き上げた、洗練のチタニウムモデル。\r\n圧倒的な軽さと小ぶりサイズな上に、定期的な電池交換も時刻合わせもいらない、エコ・ドライブ電波時計を搭載。\r\n他にも、カンパノラ、アテッサ、エクシード、ウィッカなどほとんどの商品を取り扱っています。 '),
(27239, 4844, '_categories_1_category_content_2_image', 'field_5808322599b34'),
(27238, 4844, 'categories_1_category_content_2_image', '4696'),
(27237, 4844, '_categories_1_category_content_1_discription', 'field_5808329799b36'),
(27236, 4844, 'categories_1_category_content_1_discription', 'セイコー ルキアは、前向きに自分らしく生きていく女性たちを輝かせるウオッチ。高機能とスマートなデザインをあわせ持ち、たくさんの女性たちに支持されています。\r\n\r\n他にもブライツ、グランドセイコーなどセイコーのほとんどの商品を取り扱っています。'),
(27235, 4844, '_categories_1_category_content_1_title', 'field_5808324599b35'),
(27234, 4844, 'categories_1_category_content_1_title', 'セイコールキア'),
