(27231, 4844, '_categories_1_category_content_0_discription', 'field_5808329799b36'),
(27230, 4844, 'categories_1_category_content_0_discription', '2007年、ベルギー発のファッションウォッチ「アイスウォッチ」。\r\n\r\n世界100カ国以上の国と地域で販売されています。\r\n海外セレブから国内の芸能人にも多数愛用されています。\r\n\r\n多彩な色とユニークな素材を使い、高品質ながらお求め\r\nやすい価格なのも魅力の一つです。 '),
