(27265, 4844, '_categories_2_category_content_2_title', 'field_5808324599b35'),
(27266, 4844, 'categories_2_category_content_2_discription', 'ヨシダでは、お客様に「頼んでよかった！」といっていただけるようにご希望のデザインや価格に充分にご納得いただいた上で加工を行っております。「ちょっとデザインを変えたい」というご要望にはプチプライスでお応え致しますので、お気軽にご相談下さい。\r\n\r\n１．ご来店・ご相談\r\n２．あなたにあったプランを選択\r\n３．職人による加工\r\n４．ご納品\r\n\r\nあなたの想いが詰まったジュエリーが完成！'),
(27267, 4844, '_categories_2_category_content_2_discription', 'field_5808329799b36'),
(27268, 4844, 'categories_2_category_content', '3'),
