(27271, 4844, '_appearance_0_title', 'field_58181ebe7c19a'),
(27272, 4844, 'appearance_0_comment', '最新情報発信中➟ブログ・Ｆｅｃｅｂｏｏｋ\r\n社長・スタッフが日々更新中！！\r\n\r\n新商品の紹介・入荷予定日・お客様の紹介\r\nなど充実な内容♪'),
(27273, 4844, '_appearance_0_comment', 'field_58181eff7c19b'),
(27274, 4844, 'appearance_0_image', '4714'),
(27275, 4844, '_appearance_0_image', 'field_58181f217c19c'),
(27276, 4844, 'appearance_1_title', 'メッセージ・ サービス・ イベント'),
(27277, 4844, '_appearance_1_title', 'field_58181ebe7c19a'),
(27278, 4844, 'appearance_1_comment', '明治16年\r\n\r\n佐賀の士族だった初代吉田清一郎、横浜にてアメリカ人のエンソン氏に師事し、時計技術を学ぶ。\r\n\r\n明治18年\r\n\r\n故郷佐賀にて時計店を開業。\r\n\r\n～\r\n\r\n平成25年\r\n\r\n第3回北九州市オンリーワン企業大賞を小売業界で初受賞。\r\n\r\n平成26年\r\n\r\n第20回福岡ひびき経営者賞受賞（販売サービス部門）\r\n\r\n\r\n平成27年　１年間を通じて創業130年祭実施中！\r\n\r\nぜひの御来店をお願い致します。'),
(27279, 4844, '_appearance_1_comment', 'field_58181eff7c19b'),
