(27363, 4845, 'categories_0_category_content_3_discription', '彩り豊かなフレンチデザインがメガネを楽しくしてくれます。\r\nラフォンの魅力をご紹介したブログ☆\r\nヨシダスタッフブログをぜひご覧ください♪'),
(27364, 4845, '_categories_0_category_content_3_discription', 'field_5808329799b36'),
(27365, 4845, 'categories_0_category_content', '4'),
(27366, 4845, '_categories_0_category_content', 'field_5807d5dffe066'),
(27367, 4845, 'categories_1_category_name', '●時計'),
(27368, 4845, '_categories_1_category_name', 'field_5807d57dfe064'),
(27369, 4845, 'categories_1_hide_flg', ''),
(27370, 4845, '_categories_1_hide_flg', 'field_5807d59cfe065'),
(27371, 4845, 'categories_1_category_content_0_image', '4694'),
(27372, 4845, '_categories_1_category_content_0_image', 'field_5808322599b34'),
(27373, 4845, 'categories_1_category_content_0_title', 'アイスウォッチ'),
(27374, 4845, '_categories_1_category_content_0_title', 'field_5808324599b35'),
(27375, 4845, 'categories_1_category_content_0_discription', '2007年、ベルギー発のファッションウォッチ「アイスウォッチ」。\r\n\r\n世界100カ国以上の国と地域で販売されています。\r\n海外セレブから国内の芸能人にも多数愛用されています。\r\n\r\n多彩な色とユニークな素材を使い、高品質ながらお求め\r\nやすい価格なのも魅力の一つです。 '),
(27376, 4845, '_categories_1_category_content_0_discription', 'field_5808329799b36'),
(27377, 4845, 'categories_1_category_content_1_image', '4695'),
(27378, 4845, '_categories_1_category_content_1_image', 'field_5808322599b34'),
(27379, 4845, 'categories_1_category_content_1_title', 'セイコールキア'),
(27380, 4845, '_categories_1_category_content_1_title', 'field_5808324599b35'),
(27381, 4845, 'categories_1_category_content_1_discription', 'セイコー ルキアは、前向きに自分らしく生きていく女性たちを輝かせるウオッチ。高機能とスマートなデザインをあわせ持ち、たくさんの女性たちに支持されています。\r\n\r\n他にもブライツ、グランドセイコーなどセイコーのほとんどの商品を取り扱っています。'),
(27382, 4845, '_categories_1_category_content_1_discription', 'field_5808329799b36'),
(27383, 4845, 'categories_1_category_content_2_image', '4696'),
(27384, 4845, '_categories_1_category_content_2_image', 'field_5808322599b34'),
(27385, 4845, 'categories_1_category_content_2_title', 'シチズン　クロスシー'),
(27386, 4845, '_categories_1_category_content_2_title', 'field_5808324599b35'),
(27387, 4845, 'categories_1_category_content_2_discription', '軽く、肌にやさしく、美しい。\r\nクロスシーが磨き上げた、洗練のチタニウムモデル。\r\n圧倒的な軽さと小ぶりサイズな上に、定期的な電池交換も時刻合わせもいらない、エコ・ドライブ電波時計を搭載。\r\n他にも、カンパノラ、アテッサ、エクシード、ウィッカなどほとんどの商品を取り扱っています。 '),
(27388, 4845, '_categories_1_category_content_2_discription', 'field_5808329799b36'),
(27389, 4845, 'categories_1_category_content', '3'),
(27390, 4845, '_categories_1_category_content', 'field_5807d5dffe066'),
(27391, 4845, 'categories_2_category_name', '●宝石／マリッジリング／宝石リフォーム'),
(27392, 4845, '_categories_2_category_name', 'field_5807d57dfe064'),
(27393, 4845, 'categories_2_hide_flg', ''),
(27394, 4845, '_categories_2_hide_flg', 'field_5807d59cfe065'),
(27395, 4845, 'categories_2_category_content_0_image', '4698'),
(27396, 4845, '_categories_2_category_content_0_image', 'field_5808322599b34'),
(27397, 4845, 'categories_2_category_content_0_title', 'マリッジリング『遥』'),
(27398, 4845, '_categories_2_category_content_0_title', 'field_5808324599b35'),
(27399, 4845, 'categories_2_category_content_0_discription', 'ピンクゴールドとホワイトゴールドを使った遥ならではのデザイン。\r\n\r\n画像のリングは、幅が4mmのデザインです。\r\n\r\n少し太めの6ミリ幅のリングもございます。\r\n\r\n細身なので、着けやすいです。\r\nホワイトゴールドとピンクゴールドの組み合わせが優しい印象を与えます。'),
(27400, 4845, '_categories_2_category_content_0_discription', 'field_5808329799b36'),
(27401, 4845, 'categories_2_category_content_1_image', '4700'),
(27402, 4845, '_categories_2_category_content_1_image', 'field_5808322599b34'),
(27403, 4845, 'categories_2_category_content_1_title', '最高級真珠　花珠真珠と黒蝶真珠'),
(27404, 4845, '_categories_2_category_content_1_title', 'field_5808324599b35'),
(27405, 4845, 'categories_2_category_content_1_discription', '成人、ご就職、ご結婚、厄除けのお祝いに花珠真珠、\r\n法事などのお悔やみの席に黒蝶真珠をおすすめいたします。\r\n\r\nどちらもフォーマルのシーンにはかかせないもの。\r\n\r\n昔から変わることないデザインは、どの世代の方にも、どんなタイプの\r\n方が着けても襟元をきれいに飾ってくれます。\r\n\r\n人生の節目の時にお母様からお嬢様へのプレゼントにいかがでしょうか。\r\n'),
(27406, 4845, '_categories_2_category_content_1_discription', 'field_5808329799b36'),
(27407, 4845, 'categories_2_category_content_2_image', '4828'),
(27408, 4845, '_categories_2_category_content_2_image', 'field_5808322599b34'),
(27409, 4845, 'categories_2_category_content_2_title', '宝石リフォーム'),
(27410, 4845, '_categories_2_category_content_2_title', 'field_5808324599b35'),
(27411, 4845, 'categories_2_category_content_2_discription', 'ヨシダでは、お客様に「頼んでよかった！」といっていただけるようにご希望のデザインや価格に充分にご納得いただいた上で加工を行っております。「ちょっとデザインを変えたい」というご要望にはプチプライスでお応え致しますので、お気軽にご相談下さい。\r\n\r\n１．ご来店・ご相談\r\n２．あなたにあったプランを選択\r\n３．職人による加工\r\n４．ご納品\r\n\r\nあなたの想いが詰まったジュエリーが完成！'),
(27412, 4845, '_categories_2_category_content_2_discription', 'field_5808329799b36'),
(27413, 4845, 'categories_2_category_content', '3'),
(27414, 4845, '_categories_2_category_content', 'field_5807d5dffe066'),
(27415, 4845, 'categories', '3'),
(27416, 4845, '_categories', 'field_5807d4f3fe062'),
(27417, 4845, 'appearance_0_title', 'メッセージ・ サービス・ イベント'),
(27418, 4845, '_appearance_0_title', 'field_58181ebe7c19a'),
(27419, 4845, 'appearance_0_comment', '最新情報発信中➟ブログ・Ｆｅｃｅｂｏｏｋ\r\n社長・スタッフが日々更新中！！\r\n\r\n新商品の紹介・入荷予定日・お客様の紹介\r\nなど充実な内容♪'),
(27420, 4845, '_appearance_0_comment', 'field_58181eff7c19b'),
(27421, 4845, 'appearance_0_image', '4714'),
(27422, 4845, '_appearance_0_image', 'field_58181f217c19c'),
(27423, 4845, 'appearance_1_title', 'メッセージ・ サービス・ イベント'),
(27424, 4845, '_appearance_1_title', 'field_58181ebe7c19a'),
(27425, 4845, 'appearance_1_comment', '明治16年\r\n\r\n佐賀の士族だった初代吉田清一郎、横浜にてアメリカ人のエンソン氏に師事し、時計技術を学ぶ。\r\n\r\n明治18年\r\n\r\n故郷佐賀にて時計店を開業。\r\n\r\n～\r\n\r\n平成25年\r\n\r\n第3回北九州市オンリーワン企業大賞を小売業界で初受賞。\r\n\r\n平成26年\r\n\r\n第20回福岡ひびき経営者賞受賞（販売サービス部門）\r\n\r\n\r\n平成27年　１年間を通じて創業130年祭実施中！\r\n\r\nぜひの御来店をお願い致します。'),
